INSERT INTO `posts` VALUES (4,'Kawasaki Z400 2021 giá từ 149 triệu đồng tại Việt Nam','posts/l6sywyFX8iX1aWU61b6NuTWynA63u3K4mOrQdfYL.jpg',NULL,'Kawasaki Z400 nằm ở nhóm nakedbike cỡ trung, phù hợp với những người mới chơi mô tô với mức giá tiếp cận và sức mạnh động cơ đủ dùng','<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Kawasaki Z400 2022\" src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/112021/30/11/3029_Kawasaki_Z400.jpg?rt=20211130113030\" title=\"Kawasaki Z400 2022\" /></td>\r\n		</tr>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Ng&agrave;y 29/11, Kawasaki giới thiệu Z400 đời 2021 tại thị trường Việt Nam với gi&aacute; b&aacute;n 149 triệu đồng. Xe l&agrave; đối thủ trực tiếp của KTM Duke 390 (170 triệu đồng), nhưng c&oacute; sức mạnh ấn tượng hơn với động cơ xy-lanh đ&ocirc;i, dung t&iacute;ch 399cc, cho c&ocirc;ng suất 45 m&atilde; lực v&agrave; m&ocirc;-men xoắn 38Nm. Trong khi KTM Duke 390 trang bị động cơ xy-lanh đơn, dung t&iacute;ch 373cc, cho c&ocirc;ng suất 44 m&atilde; lực v&agrave; m&ocirc;-men xoắn 37Nm.</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Kawasaki Z400 2022\" src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/112021/30/11/3027_Kawasaki_Z400_10.jpg?rt=20211130113055\" title=\"Kawasaki Z400 2022\" /></td>\r\n		</tr>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Ở đời xe mới, h&atilde;ng xe Nhật Bản mang đến 2 t&ugrave;y chọn m&agrave;u sắc cho Z400 ABS gồm xanh-đen Lime Candy v&agrave; đen &ndash; x&aacute;m Graphite. C&ograve;n lại, mẫu m&ocirc;t&ocirc; Nhật Bản kh&ocirc;ng c&oacute; sự thay đổi n&agrave;o đ&aacute;ng kể so với đời xe trước.</p>\r\n\r\n<p>Kawasaki Z400 sở hữu thiết kế thể thao v&agrave; bắt mắt Sugomi tương đồng với đ&agrave;n anh Z650 v&agrave; Z900, ph&ugrave; hợp với những người mới nhập m&ocirc;n th&uacute; chơi m&ocirc; t&ocirc; ph&acirc;n khối lớn. Xe c&oacute; 2 t&ugrave;y chọn m&agrave;u sắc tại Việt Nam. Đ&egrave;n pha v&agrave; đ&egrave;n hậu đều sử dụng c&ocirc;ng nghệ LED.</p>\r\n\r\n<p>Bảng đồng hồ trung t&acirc;m dạng kết hợp giữa analog v&agrave; m&agrave;n h&igrave;nh LCD hiển thị 3 chế độ kh&aacute;c nhau. M&agrave;n h&igrave;nh n&agrave;y thua thiệt so với đối thủ, khi KTM Duke 390 sử dụng m&agrave;n h&igrave;nh Full LCD. Kawasaki Z400 cũng chưa được trang bị c&aacute;c t&iacute;nh năng cao cấp như kết nối điện thoại hay ch&igrave;a kh&oacute;a th&ocirc;ng minh.</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Kawasaki Z400 2022\" src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/112021/30/11/3024_Kawasaki_Z400_3.jpg?rt=20211130113104\" title=\"Kawasaki Z400 2022\" /></td>\r\n		</tr>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Tư thế ngồi l&aacute;i Kawasaki Z400 hơi chồm về ph&iacute;a trước, nhưng ghi đ&ocirc;ng rộng gi&uacute;p chiếc xe dễ d&agrave;ng xoay sở nơi đ&ocirc;ng đ&uacute;c. Hộp số 6 cấp.</p>\r\n\r\n<p>K&iacute;ch thước tổng thể d&agrave;i x rộng x cao lần lượt l&agrave; 1.990 x 800 x 1.055mm, chiều d&agrave;i cơ sở 1.370mm, khoảng s&aacute;ng gầm 145mm. Chiều cao y&ecirc;n 785mm ở mức vừa phải, c&ugrave;ng 2 b&ecirc;n y&ecirc;n được thiết kế mỏng 30mm ph&ugrave; hợp với thể trạng đại đa số người Việt. Xe nặng 167kg.</p>\r\n\r\n<p>M&acirc;m trước sau đồng k&iacute;ch thước 17 inch. Phuộc trước chỉ sử dụng loại ống lồng k&iacute;ch thước 41mm, c&ograve;n ph&iacute;a sau l&agrave; phuộc đơn loại Uni Trak c&oacute; khả năng điều chỉnh 5 mức độ. Phanh đĩa hai b&aacute;nh l&agrave; trang bị ti&ecirc;u chuẩn, kết hợp với c&ocirc;ng nghệ chống b&oacute; cứng phanh ABS.</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Kawasaki Z400 2022\" src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/112021/30/11/3022_Kawasaki_Z400_2.jpg?rt=20211130113114\" title=\"Kawasaki Z400 2022\" /></td>\r\n		</tr>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Z400 sử dụng khung sườn dạng Trellis, tương tự như tr&ecirc;n Kawasaki Ninja H2, được hệ thống ph&acirc;n t&iacute;ch độ cứng của h&atilde;ng m&ocirc; t&ocirc; Nhật Bản nghi&ecirc;n cứu để tăng độ cứng v&agrave; tiết giảm trọng lượng.</p>',7945,1,'2021-12-04 02:04:09','2022-01-27 10:45:19'),(5,'Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng','posts/71HLeFQc1fuJFhwzQeFomx6thyAGwy1Blj1d0lOZ.png',NULL,'Honda giới thiệu loạt phiên bản mới cho các mẫu xe phân khối lớn: CB1000R, CB650R và CBR650R, giá dao động từ 246 - 509 triệu đồng','<p>Honda giới thiệu loạt phi&ecirc;n bản mới cho c&aacute;c mẫu xe ph&acirc;n khối lớn: CB1000R, CB650R v&agrave; CBR650R, gi&aacute; dao động từ 246 - 509 triệu đồng</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><a href=\"https://autobikes.vn/honda-winner-x-2022-the-he-moi-ruc-rich-ra-mat-tai-viet-nam-13438.html\" title=\"Honda Winner X 2022 thế hệ mới rục rịch ra mắt tại Việt Nam\">Honda Winner X 2022 thế hệ mới rục rịch ra mắt tại Việt Nam</a><a href=\"https://autobikes.vn/honda-lead125-2022-gia-tu-39-trieu-dong-tai-viet-nam-13428.html\" title=\"Honda Lead125 2022 giá từ 39 triệu đồng tại Việt Nam\">Honda Lead125 2022 gi&aacute; từ 39 triệu đồng tại Việt Nam</a><a href=\"https://autobikes.vn/tieu-thu-xe-may-cua-honda-tang-manh-trong-thang-11-13413.html\" title=\"Tiêu thụ xe máy của Honda tăng mạnh trong tháng 11\">Ti&ecirc;u thụ xe m&aacute;y của Honda tăng mạnh trong th&aacute;ng 11</a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0656_KV.jpg?rt=20211218231051\" title=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" /></td>\r\n		</tr>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>V&agrave;o năm 2018, Honda Việt Nam ch&iacute;nh thức gia nhập ph&acirc;n kh&uacute;c xe m&ocirc; t&ocirc; ph&acirc;n khối lớn bằng việc ph&acirc;n phối c&aacute;c d&ograve;ng xe nhập khẩu c&oacute; dung t&iacute;ch động cơ lớn thuộc đa dạng ph&acirc;n kh&uacute;c nhằm thỏa m&atilde;n những khao kh&aacute;t trải nghiệm v&agrave; đam m&ecirc; chinh phục những cung đường của c&aacute;c t&iacute;n đồ đam m&ecirc; tốc độ.</p>\r\n\r\n<p>Với tinh thần kh&ocirc;ng ngừng nỗ lực nhằm thỏa m&atilde;n thị hiếu ng&agrave;y c&agrave;ng cao v&agrave; đa dạng của kh&aacute;ch h&agrave;ng, HVN ch&iacute;nh thức giới thiệu phi&ecirc;n bản mới c&aacute;c mẫu xe thuộc 2 d&ograve;ng: Naked &amp; Super Sports v&agrave;o ng&agrave;y 18/12/2021.</p>\r\n\r\n<p>Phi&ecirc;n bản ho&agrave;n to&agrave;n mới Honda&nbsp;CB1000R 2021 mạnh mẽ, dữ dằn hơn v&agrave; tạo cảm gi&aacute;c lao về ph&iacute;a trước nhiều hơn với kiểu d&aacute;ng được thiết kế như một d&ograve;ng chảy h&agrave;i h&ograve;a từ trước ra sau.</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0635_Honda_CB1000R_2021__2.png?rt=20211218231114\" title=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" /></td>\r\n		</tr>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>M&acirc;m xe 7 chấu nh&ocirc;m đ&uacute;c được thiết kế mới, cụm đ&egrave;n trước được trang bị đ&egrave;n LED to&agrave;n bộ, đ&egrave;n hậu được trang bị T&iacute;n hiệu dừng khẩn cấp (ESS), c&aacute;c tấm ốp k&eacute;t tản nhiệt m&agrave;u nh&ocirc;m nhỏ gọn hơn, ốp che lọc gi&oacute; cũng được điều chỉnh thiết kế, gi&aacute; gắn biển số được thu nhỏ gọn lại, trang bị ổ cắm sạc USB dưới y&ecirc;n xe.</p>\r\n\r\n<p>CB1000R 2021 sở hữu khung th&eacute;p kiểu xương sống đơn v&agrave; gắp sau đơn d&agrave;i 574.2mm, xe vẫn được trang bị phuộc USD Showa SFF-BP ph&iacute;a trước v&agrave; ph&iacute;a sau l&agrave; phuộc đơn c&oacute; khả năng điều chỉnh tải trước l&ograve; xo v&agrave; mức giảm chấn c&oacute; thể điều chỉnh. Hệ thống phanh gồm 2 ng&agrave;m phanh 4 p&iacute;t-t&ocirc;ng gắn hướng t&acirc;m tr&ecirc;n đĩa đ&ocirc;i 310 mm ph&iacute;a trước. Ph&iacute;a sau l&agrave; ng&agrave;m phanh p&iacute;t-t&ocirc;ng đ&ocirc;i, đĩa phanh 256 mm c&ugrave;ng hệ thống chống b&oacute; cứng phanh ABS 2 k&ecirc;nh.</p>\r\n\r\n<p>Phi&ecirc;n bản mới n&agrave;y trang bị m&agrave;n h&igrave;nh m&agrave;u TFT 5 inch c&oacute; bốn t&ugrave;y chọn hiển thị tốc độ v&ograve;ng quay động cơ tuỳ theo sở th&iacute;ch của người điều khiển. CB1000R Neo Sports Caf&eacute; sẽ được đưa ra thị trường với 3 lựa chọn m&agrave;u sắc bao gồm Đỏ, Đen v&agrave; Bạc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0648_Honda_CB1000R_2021__3.png\" /></a>\r\n\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0646_Honda_CB1000R_2021__1.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0646_Honda_CB1000R_2021__2.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0635_Honda_CB1000R_2021__2.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0639_Honda_CB1000R_2021__5.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0643_Honda_CB1000R_2021__8.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0641_Honda_CB1000R_2021__7.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0640_Honda_CB1000R_2021__6.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0634_Honda_CB1000R_2021__1.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0637_Honda_CB1000R_2021__4.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0636_Honda_CB1000R_2021__3.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sức mạnh của CB1000R 2021 l&agrave; khối động cơ DOHC 4 xy lanh dung t&iacute;ch 998cc, cho c&ocirc;ng suất tối đa 107 kW tại 10.500 v&ograve;ng/ph&uacute;t v&agrave; m&ocirc; men xoắn cực đại đạt 104Nm tại 8.250 v&ograve;ng/ph&uacute;t. Phi&ecirc;n bản ho&agrave;n to&agrave;n mới được tinh chỉnh để tối ưu h&oacute;a hệ thống phun xăng điện tử PGM-FI, đ&aacute;p ứng ti&ecirc;u chuẩn kh&iacute; thải EURO 5.</p>\r\n\r\n<p>Hệ thống ga điện tử TBW (Throttle by Wire) đi k&egrave;m với 3 chế độ chạy ri&ecirc;ng biệt v&agrave; một chế độ t&ugrave;y chọn (k&iacute;ch hoạt từ n&uacute;t điều khiển b&ecirc;n tr&aacute;i), c&ugrave;ng ba mức tuỳ chỉnh cho Sức mạnh động cơ (P), Lực phanh động cơ (EB) v&agrave; Hệ thống kiểm so&aacute;t lực k&eacute;o của Honda (HSTC) - c&oacute; thể tuỳ chỉnh tắt. Đối với mỗi chế độ l&aacute;i (RAIN, STANDARD, SPORT), mỗi th&ocirc;ng số ở tr&ecirc;n được t&ugrave;y chỉnh tương ứng.</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1637_KV.jpg?rt=20211218231637\" title=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" /></td>\r\n		</tr>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Trong khi đ&oacute;, Honda CB650R thế hệ mới tiếp tục duy tr&igrave; thiết kế tinh giản kết hợp với những đường n&eacute;t t&aacute;o bạo, mang lại ấn tượng ngay từ c&aacute;i nh&igrave;n đầu ti&ecirc;n. B&ecirc;n cạnh 3 m&agrave;u Đỏ, Đen v&agrave; Xanh, phi&ecirc;n bản mới được bổ sung m&agrave;u X&aacute;m mới, t&ocirc;n l&ecirc;n sự khỏe khoắn v&agrave; mạnh mẽ cho chủ sở hữu.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0036_Honda_CB650R__1.png\" /></a>\r\n\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0037_Honda_CB650R__2.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0038_Honda_CB650R__3.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0039_Honda_CB650R__4.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0028_Honda_CB650R__1.jpg\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0029_Honda_CB650R__3.jpg\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0030_Honda_CB650R__4.jpg\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0031_Honda_CB650R__5.jpg\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0032_Honda_CB650R__6.jpg\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0033_Honda_CB650R__7.jpg\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0034_Honda_CB650R__8.jpg\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/0028_Honda_CB650R__2.jpg\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>CB650R sử dụng động cơ 4 xy-lanh thẳng h&agrave;ng, DOHC 16 van sản sinh c&ocirc;ng suất 70kW tại v&ograve;ng tua m&aacute;y 12.000 v&ograve;ng/ph&uacute;t c&ugrave;ng với m&ocirc;-men xoắn mạnh mẽ 63Nm. Xe được trang bị t&iacute;nh năng Kiểm so&aacute;t lực k&eacute;o (HSTC), kết hợp c&ugrave;ng ly hợp chống trượt 2 chiều.</p>\r\n\r\n<p>Phi&ecirc;n bản mới duy tr&igrave; trang bị hệ thống phanh t&acirc;n tiến c&ugrave;ng cổng sạc USB tiện lợi được đặt dưới y&ecirc;n sau của xe v&agrave; xe cũng đ&aacute;p ứng ti&ecirc;u chuẩn EURO5.</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1349_KV.png?rt=20211218231602\" title=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" /></td>\r\n		</tr>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Với phi&ecirc;n bản mới, CBR650R mẫu xe tiếp tục giữ hậu tố &ldquo;R&rdquo; đặc trưng, tuy nhi&ecirc;n được thay đổi thiết kế tem xe, với hai m&agrave;u Đen v&agrave; Đỏ với thiết kế tem ấn tượng. Bản m&agrave;u Đen c&oacute; viền tem h&igrave;nh tia chớp chạy dọc yếm xe được chuyển từ Trắng sang Đỏ nổi bật. Trong khi đ&oacute; bản m&agrave;u Đỏ được biến h&oacute;a tem xe với dải chữ V đậm m&agrave;u Đen cắt xuy&ecirc;n từ b&igrave;nh xăng đến yếm xe, tạo điểm nhấn thị gi&aacute;c mạnh mẽ.</p>\r\n\r\n<p>HVN tiếp tục duy tr&igrave; khối động cơ 4 xy-lanh thẳng h&agrave;ng, DOHC 16 van sản sinh c&ocirc;ng suất 70kW tại v&ograve;ng tua m&aacute;y 12.000 v&ograve;ng/ph&uacute;t c&ugrave;ng m&ocirc;-men xoắn mạnh mẽ 63Nm. Xe tiếp tục được duy tr&igrave; t&iacute;nh năng Kiểm so&aacute;t lực k&eacute;o (HSTC) của Honda gi&uacute;p tối ưu ho&aacute; khả năng b&aacute;m đường cho b&aacute;nh sau. Động cơ của mẫu xe tự h&agrave;o đạt ti&ecirc;u chuẩn kh&iacute; thải EURO5.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1331_Honda_CBR650R_2021_1.png\" /></a>\r\n\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1332_Honda_CBR650R_2021_2.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1338_Honda_CBR650R_2021_1.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1340_Honda_CBR650R_2021_3.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1341_Honda_CBR650R_2021_4.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1343_Honda_CBR650R_2021_5.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1338_Honda_CBR650R_2021_2.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1344_Honda_CBR650R_2021_6.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1346_Honda_CBR650R_2021_7.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n	<li><a href=\"\"><img src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/23/1347_Honda_CBR650R_2021_8.png\" /></a>\r\n	<p><a href=\"\"><img alt=\"Zoom\" src=\"https://autobikes.vn/modules/frontend/themes/autobikes/js/lightgallery/img/zoom.png?v=2.620211220082054\" /></a></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mẫu xe tiếp tục được trang bị c&aacute;c c&ocirc;ng nghệ v&agrave; tiện &iacute;ch cao bao gồm: ng&agrave;m phanh Radial Mount cải thiện sự c&acirc;n bằng; hệ thống đ&egrave;n b&aacute;o dừng khẩn cấp tự động được k&iacute;ch hoạt khi ph&aacute;t hiện t&igrave;nh huống phanh đột ngột của người l&aacute;i, hệ thống sẽ k&iacute;ch hoạt đ&egrave;n cảnh b&aacute;o nguy hiểm ở trước v&agrave; sau xe, cảnh b&aacute;o cho c&aacute;c phương tiện kh&aacute;c; hệ thống chống b&oacute; cứng phanh ABS 2 k&ecirc;nh giúp &ocirc;̉n định tư th&ecirc;́ của xe bằng cách ch&ocirc;́ng khóa cứng bánh xe, đặc bi&ecirc;̣t trong đi&ecirc;̀u ki&ecirc;̣n đường trơn ướt hay g&ocirc;̀ gh&ecirc;̀. Hướng đến sự tiện lợi h&oacute;a trong di chuyển cũng l&agrave; một trong những mục ti&ecirc;u m&agrave; nh&agrave; sản xuất đặt ra. Ch&iacute;nh v&igrave; vậy, mẫu xe được trang bị cổng sạc USB tiện lợi được đặt dưới y&ecirc;n sau của xe.</p>\r\n\r\n<p>Phi&ecirc;n bản mới hai mẫu xe CB650R v&agrave; CBR650R sẽ được b&aacute;n ch&iacute;nh thức ra thị trường từ ng&agrave;y 26 th&aacute;ng 12 năm 2021. Trong khi đ&oacute;, phi&ecirc;n bản ho&agrave;n to&agrave;n mới mẫu xe CB1000R dự kiến sẽ được b&aacute;n ch&iacute;nh thức từ ng&agrave;y 16 th&aacute;ng 1 năm 2022. Cả ba mẫu xe đều được b&aacute;n th&ocirc;ng qua hệ thống Cửa h&agrave;ng xe Ph&acirc;n khối lớn Honda. Chế độ bảo h&agrave;nh 2 năm v&agrave; kh&ocirc;ng giới hạn km.</p>\r\n\r\n<p><em>Mức gi&aacute; đề xuất lần lượt l&agrave;:</em></p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" src=\"https://autobikes.vn/stores/news_dataimages/nguyenthuy/122021/18/22/4309_Honda.png?rt=20211218224309\" title=\"Honda ra mắt 3 mẫu xe phân khối lớn, giá từ 246 triệu đồng\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>',3527,1,'2021-12-04 02:04:09','2022-01-27 10:42:12'),(12,'Huyền thoại Honda Super Cub C125 có phiên bản mới','posts/ssxTNiSU9zbi9ZOoOk96FN3GJcedNys6422UXehz.png',NULL,'Honda Super Cub C125 được nhập khẩu nguyên chiếc từ Thái Lan sẽ được phân phối chính thức ra thị trường với hai phiên bản tiêu chuẩn và đặc biệt.','<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/xe-xanh-trang-dam.png\" id=\"post-img-0\" rel=\"view_image_post_6733\" title=\"Huyền thoại Honda Super Cub C125 có phiên bản mới\"><img alt=\"Huyền thoại Honda Super Cub C125 có phiên bản mới\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/xe-xanh-trang-dam.png\" style=\"width:100%\" /></a></p>\r\n\r\n<p><em>Honda Super Cub C125 được nhập khẩu nguy&ecirc;n chiếc từ Th&aacute;i Lan sẽ được ph&acirc;n phối ch&iacute;nh thức ra thị trường với hai phi&ecirc;n bản ti&ecirc;u chuẩn v&agrave; đặc biệt.</em></p>\r\n\r\n<p>Honda Super Cub C125 thừa kế phong c&aacute;ch thiết kế ho&agrave;i cổ với h&igrave;nh ảnh truyền thống đặc trưng của d&ograve;ng Cub. Mẫu xe sở hữu thiết kế theo h&igrave;nh chữ S, tạo ấn tượng về sự h&agrave;i h&ograve;a mềm mại cho tổng thể xe. HVN bổ sung phi&ecirc;n bản Đặc biệt với m&agrave;u Đen nh&aacute;m ho&agrave;n to&agrave;n mới vừa gợi vẻ đẹp huyền b&iacute; vừa thể hiện n&eacute;t hiện đại đối với xu hướng m&agrave;u sắc những năm gần đ&acirc;y.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/den-led-toan-bo_xanh.png?1634426069430\" id=\"post-img-1\" rel=\"highlight6733\" title=\"den-led-toan-bo_xanh\"><img alt=\"den-led-toan-bo_xanh\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/den-led-toan-bo_xanh.png?1634426069430\" title=\"den-led-toan-bo_xanh\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mẫu xe huyền thoại được trang bị động cơ với dung t&iacute;ch 123,94cc, l&agrave;m m&aacute;t bằng kh&ocirc;ng kh&iacute;, 4 kỳ, xy lanh đơn, trang bị PGM-FI, mang lại khả năng vận h&agrave;nh mạnh mẽ v&agrave; tiết kiệm nhi&ecirc;n liệu. Xe đạt c&ocirc;ng suất tối đa 6,87kW tại mức tốc độ động cơ 7.500 v&ograve;ng/ph&uacute;t v&agrave; m&ocirc; men cực đại 10,15Nm tại mức tốc độ động cơ 5.000 v&ograve;ng/ph&uacute;t.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/yen-sau-moi_den.png?1634426085938\" id=\"post-img-2\" rel=\"highlight6733\" title=\"yen-sau-moi_den\"><img alt=\"yen-sau-moi_den\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/yen-sau-moi_den.png?1634426085938\" title=\"yen-sau-moi_den\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Y&ecirc;n được sử dụng lớp đệm Urethane c&oacute; độ d&agrave;y lớn, khả năng đ&agrave;n hồi cao, gi&uacute;p tăng tối đa độ &ecirc;m &aacute;i v&agrave; tạo cảm gi&aacute;c thoải m&aacute;i cho người đồng h&agrave;nh. Kh&ocirc;ng chỉ c&oacute; gi&aacute; trị cao về mặt tiện &iacute;ch, y&ecirc;n xe mới c&ograve;n l&agrave;m nổi bật phong c&aacute;ch của chủ sở hữu nhờ sự h&agrave;i h&ograve;a trong lựa chọn m&agrave;u sắc giữa y&ecirc;n v&agrave; tổng thể thiết kế m&agrave;u xe, gi&uacute;p l&ocirc;i cuốn &aacute;nh nh&igrave;n của người đối diện. Mẫu xe tiếp tục duy tr&igrave; trang bị đ&egrave;n LED to&agrave;n bộ c&ugrave;ng ch&igrave;a kho&aacute; th&ocirc;ng minh SMART Key với điểm nhấn logo c&aacute;nh chim 3D truyền thống được trang bị 3 chức năng: Cảnh b&aacute;o chống trộm, x&aacute;c định vị tr&iacute; xe th&ocirc;ng minh v&agrave; khởi động hệ thống điện. Đ&acirc;y được coi l&agrave; một n&eacute;t chấm ph&aacute; trong sự ho&agrave; trộn cổ điển v&agrave; hiện đại của Super Cub C125.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/xe-den-nham.png?1634426101295\" id=\"post-img-3\" rel=\"highlight6733\" title=\"xe-den-nham\"><img alt=\"xe-den-nham\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/xe-den-nham.png?1634426101295\" title=\"xe-den-nham\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Gi&aacute; b&aacute;n lẻ đề xuất của Honda Super Cub C125 như sau:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/anh-chup-man-hinh-2021-10-17-luc-06.13.41.png?1634426038997\" id=\"post-img-4\" rel=\"highlight6733\" title=\"anh-chup-man-hinh-2021-10-17-luc-06.13.41\"><img alt=\"anh-chup-man-hinh-2021-10-17-luc-06.13.41\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/10/17/anh-chup-man-hinh-2021-10-17-luc-06.13.41.png?1634426038997\" title=\"anh-chup-man-hinh-2021-10-17-luc-06.13.41\" /></a></p>',4289,1,'2021-12-04 02:04:09','2022-01-27 10:04:02'),(13,'VinFast Theon và Feliz: Bộ đôi \"tân binh\" xe máy điện vừa trình làng','posts/HoHYNf6P4VqTNOc8JHoB3PikfZVNzlqwFwNSPtY0.jpg',NULL,'VinFast vừa công bố mở bán hai dòng xe máy điện mới Theon và Feliz, khẳng định năng lực nghiên cứu phát triển công nghệ hàng đầu trên thị trường xe điện thông minh.','<p><img alt=\"VinFast Theon và Feliz: Bộ đôi \" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/01/25/xe-may-dien-vinfast-theon-1.jpg\" /></p>\r\n\r\n<p><em>VinFast vừa c&ocirc;ng bố mở b&aacute;n hai d&ograve;ng xe m&aacute;y điện mới Theon v&agrave; Feliz, khẳng định năng lực nghi&ecirc;n cứu ph&aacute;t triển c&ocirc;ng nghệ h&agrave;ng đầu tr&ecirc;n thị trường xe điện th&ocirc;ng minh.</em></p>\r\n\r\n<p>VinFast&nbsp;Theon l&agrave; d&ograve;ng xe m&aacute;y điện đại diện cho tốc độ, sự s&aacute;ng tạo, ph&aacute;t triển kh&ocirc;ng ngừng của VinFast. Xe sở hữu đường n&eacute;t mạnh mẽ, đẳng cấp, thời thượng, vận h&agrave;nh vượt trội v&agrave; dẫn đầu về c&ocirc;ng nghệ th&ocirc;ng minh. Mẫu xe m&aacute;y điện thiết kế nam t&iacute;nh mang t&ecirc;n Theon được trang bị động cơ đặt giữa c&ugrave;ng với hệ truyền động bằng d&acirc;y x&iacute;ch c&oacute; c&ocirc;ng suất l&ecirc;n đến 7.100 W, c&oacute; thể đạt được 9.000 W tương đương với 12 m&atilde; lực v&agrave; m&ocirc;-men xoắn cực đại 22,27 Nm. Sức mạnh n&agrave;y gi&uacute;p Theon tăng tốc từ 0 đến 50km/h chỉ trong 6 gi&acirc;y, tốc độ tối đa 90 km/h.</p>\r\n\r\n<p>Di chuyển ở tốc độ cao nhưng Theon đặc biệt an to&agrave;n nhờ hệ thống treo, khung gầm chịu lực chắc chắn, phuộc trước v&agrave; sau của nh&agrave; cung cấp danh tiếng Showa, phanh của Nissin. Ngo&agrave;i ra, Theon c&ograve;n được trang bị t&iacute;nh năng an to&agrave;n chỉ xuất hiện ở những d&ograve;ng xe cao cấp, đ&oacute; l&agrave; hệ thống chống b&oacute; cứng phanh ABS 2 k&ecirc;nh của Continental, hỗ trợ người l&aacute;i duy tr&igrave; được khả năng kiểm so&aacute;t tốt trong điều kiện thời tiết xấu phải phanh gấp hay di chuyển tr&ecirc;n mặt đường hiểm trở. Theon sử dụng cụm 2 pin thế hệ mới chạy song song cho ph&eacute;p xe c&oacute; thể đi được qu&atilde;ng đường l&ecirc;n tới 101km trong 1 lần sạc đầy. Tuổi thọ của thế hệ pin mới cũng ưu việt khi trải qua 2.000 lần sạc vẫn c&ograve;n 70% dung lượng.</p>\r\n\r\n<p>Đặc biệt, xe đạt ti&ecirc;u chuẩn chống nước v&agrave; bụi cao nhất tr&ecirc;n thị trường (IP67), cho ph&eacute;p hoạt động tốt trong điều kiện nước ngập s&acirc;u tới 1m &iacute;t nhất 30 ph&uacute;t li&ecirc;n tục.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/01/25/xe-may-dien-vinfast-theon-2.jpg?1611544682879\" id=\"post-img-1\" rel=\"highlight6575\" title=\"xe-may-dien-vinfast-theon-2\"><img alt=\"xe-may-dien-vinfast-theon-2\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/01/25/xe-may-dien-vinfast-theon-2.jpg?1611544682879\" title=\"xe-may-dien-vinfast-theon-2\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Về thiết kế, Theon sử dụng m&agrave;n h&igrave;nh LCD m&agrave;u cho đồng hồ, thể hiện nhiều th&ocirc;ng số như tốc độ, trạng th&aacute;i pin, nhiệt độ&hellip; Hệ thống đ&egrave;n Led sử dụng c&ocirc;ng nghệ Projector tạo ra những mặt cắt &aacute;nh s&aacute;ng kh&ocirc;ng l&agrave;m l&oacute;a mắt người đối diện. D&ograve;ng xe m&aacute;y điện mới được VinFast đặc biệt đầu tư c&ocirc;ng nghệ th&ocirc;ng minh. Theon được trang bị c&ocirc;ng nghệ hiện đại PAAK (Phone As A Key), gi&uacute;p người l&aacute;i dễ d&agrave;ng khởi động/tắt m&aacute;y, mở cốp, bật v&agrave; tắt t&iacute;nh năng chống trộm từ xa th&ocirc;ng qua ứng dụng tr&ecirc;n điện thoại. Xe cũng được thiết kế ch&igrave;a kh&oacute;a th&ocirc;ng minh (smartkey) cho ph&eacute;p bật/tắt xe trong khoảng c&aacute;ch 1m, hệ thống kết nối HMI t&iacute;ch hợp ESIM c&oacute; khả năng tự động chẩn đo&aacute;n v&agrave; cảnh b&aacute;o lỗi, tự động cập nhật phần mềm v&agrave; định vị xe (GPS) to&agrave;n cầu, quản l&yacute; mọi h&agrave;nh tr&igrave;nh...</p>\r\n\r\n<p>C&ugrave;ng ra mắt với Theon l&agrave; Feliz với kiểu d&aacute;ng thanh lịch, gọn g&agrave;ng v&agrave; tiện dụng được nghi&ecirc;n cứu v&agrave; ph&aacute;t triển ph&ugrave; hợp với nhu cầu di chuyển trong đ&ocirc; thị của số đ&ocirc;ng người Việt Nam.<br />\r\n<br />\r\nXe Feliz được trang bị động cơ c&ocirc;ng suất lớn 2.250W, tốc độ l&ecirc;n tới 60km/h v&agrave; c&oacute; khả năng đi được qu&atilde;ng đường 90km trong 1 lần sạc, cốp xe rộng r&atilde;i với thể t&iacute;ch 20 l&iacute;t. Với những ưu điểm vượt trội, gi&aacute; b&aacute;n c&ocirc;ng bố của d&ograve;ng xe Theon l&agrave; 63.900.000 đồng; kh&aacute;ch h&agrave;ng c&oacute; thể t&ugrave;y chọn mua pin với gi&aacute; 17.200.000 đồng hoặc thu&ecirc; bao pin với gi&aacute; ưu đ&atilde;i 350.000 đồng/th&aacute;ng. D&ograve;ng xe Feliz c&oacute; gi&aacute; c&ocirc;ng bố l&agrave; 24.900.000 đồng, đ&atilde; bao gồm ắc quy v&agrave; sạc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/01/25/xe-may-dien-vinfast-feliz.jpg?1611544699065\" id=\"post-img-2\" rel=\"highlight6575\" title=\"xe-may-dien-vinfast-feliz\"><img alt=\"xe-may-dien-vinfast-feliz\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/01/25/xe-may-dien-vinfast-feliz.jpg?1611544699065\" title=\"xe-may-dien-vinfast-feliz\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nh&acirc;n dịp n&agrave;y, VinFast ch&iacute;nh thức c&ocirc;ng bố m&ocirc; h&igrave;nh trải nghiệm mua sắm O2O (online to offline) nhằm đem đến c&aacute;c trải nghiệm thuận tiện, dễ d&agrave;ng v&agrave; th&uacute; vị cho kh&aacute;ch h&agrave;ng. Từ ng&agrave;y 21/1/2021, kh&aacute;ch h&agrave;ng c&oacute; thể truy cập trang thương mại điện tử của VinFast tại địa chỉ https://vinfastauto.com/ để đăng k&yacute; l&aacute;i thử, đặt h&agrave;ng hoặc trải nghiệm trực tiếp tại c&aacute;c showroom v&agrave; đại l&yacute; ch&iacute;nh thức của VinFast.</p>\r\n\r\n<p>&ldquo;Nhằm mục ti&ecirc;u thay đổi định nghĩa của người ti&ecirc;u d&ugrave;ng về xe m&aacute;y điện, VinFast đ&atilde; nghi&ecirc;n cứu, ph&aacute;t triển c&aacute;c d&ograve;ng xe m&aacute;y điện c&oacute; hiệu suất vận h&agrave;nh tương đương xe xăng v&agrave; chi ph&iacute; vận h&agrave;nh rẻ hơn. Ch&uacute;ng t&ocirc;i cũng rất ch&uacute; trọng đến kh&acirc;u thiết kế để cho ra đời c&aacute;c sản phẩm đẹp, an to&agrave;n, tiện dụng v&agrave; đẳng cấp. Kh&ocirc;ng chỉ thế, c&aacute;c d&ograve;ng xe m&aacute;y điện của VinFast được ứng dụng c&ocirc;ng nghệ cao đem đến c&aacute;c t&iacute;nh năng th&ocirc;ng minh v&agrave; trải nghiệm vượt trội cho kh&aacute;ch h&agrave;ng. VinFast sẽ tiếp tục s&aacute;ng tạo kh&ocirc;ng ngừng để gia tăng gi&aacute; trị cho kh&aacute;ch h&agrave;ng, th&uacute;c đẩy chuyển đổi th&oacute;i quen sử dụng phương tiện bảo vệ m&ocirc;i trường v&igrave; một tương lai xanh cho c&aacute;c thế hệ tương lai&rdquo;, b&agrave; Th&aacute;i Thanh Hải &ndash; Tổng gi&aacute;m đốc VinFast chia sẻ.<br />\r\nNhư vậy, chỉ trong hơn 2 năm, VinFast đ&atilde; ra mắt thị trường 6 mẫu xe m&aacute;y điện gồm: Klara, KlaraS, Ludo, Impes, Feliz v&agrave; Theon, trong đ&oacute; c&oacute; 2 mẫu xe m&aacute;y phi&ecirc;n bản giới hạn được thiết kế ri&ecirc;ng kết hợp với Sơn T&ugrave;ng M-TP, d&agrave;nh ri&ecirc;ng cho giới trẻ. Đến thời điểm n&agrave;y, VinFast đang sở hữu hệ thống gồm 120 showroom, đại l&yacute; v&agrave; 85 xưởng dịch vụ. Dự kiến năm 2021, c&ocirc;ng ty sẽ mở th&ecirc;m 200 - 400 cửa h&agrave;ng v&agrave; hơn 2.000 trạm sạc tr&ecirc;n to&agrave;n quốc nhằm đảm bảo sự tiện lợi cho kh&aacute;ch h&agrave;ng.</p>\r\n\r\n<p>Nh&acirc;n dịp ra mắt hai sản phẩm mới v&agrave; m&ocirc; h&igrave;nh trải nghiệm mua sắm O2O, VinFast &aacute;p dụng ch&iacute;nh s&aacute;ch ưu đ&atilde;i đặc biệt hấp dẫn. Tất cả c&aacute;c kh&aacute;ch h&agrave;ng đặt xe trước trong thời gian từ&nbsp;<a href=\"tel:21/1 - 31/1/2021\">21/1 - 31/1/2021</a>&nbsp;sẽ được ưu đ&atilde;i tối đa l&ecirc;n tới 3 triệu đồng khi đăng k&yacute; xe Feliz v&agrave; tới 8,1 triệu đồng với d&ograve;ng xe Theon.</p>',7079,1,'2021-12-04 02:04:09','2022-01-27 10:09:18'),(14,'Honda Việt Nam giới thiệu phiên bản mới Future 125 FI','posts/rwX6mp3GzzZ82bkhSAIXycW8nA7JhNLcGk03trwA.jpg',NULL,'Honda Future 125 FI được thiết kế trên ý tưởng “Đẳng cấp xe số Mạnh mẽ & Lịch lãm cho người đàn ông trưởng thành”.','<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/ban-cao-cap_xe-do-den.jpg\" id=\"post-img-0\" rel=\"view_image_post_6747\" title=\"Honda Việt Nam giới thiệu phiên bản mới Future 125 FI\"><img alt=\"Honda Việt Nam giới thiệu phiên bản mới Future 125 FI\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/ban-cao-cap_xe-do-den.jpg\" style=\"width:100%\" /></a></p>\r\n\r\n<p><em>Honda Future 125 FI được thiết kế tr&ecirc;n &yacute; tưởng &ldquo;Đẳng cấp xe số Mạnh mẽ &amp; Lịch l&atilde;m cho người đ&agrave;n &ocirc;ng trưởng th&agrave;nh&rdquo;.</em></p>\r\n\r\n<p>Phi&ecirc;n bản mới Future 125 FI được l&agrave;m mới với 03 phi&ecirc;n bản: Đặc biệt, Cao cấp v&agrave; Ti&ecirc;u chuẩn, mang sự biến h&oacute;a c&aacute;c chi tiết m&agrave;u sắc th&uacute; vị gi&uacute;p định h&igrave;nh phong c&aacute;ch r&otilde; n&eacute;t hơn cho đa dạng đối tượng kh&aacute;ch h&agrave;ng, hướng đến h&igrave;nh ảnh trẻ trung.</p>\r\n\r\n<p>Phi&ecirc;n bản Đặc biệt phanh đĩa - v&agrave;nh đ&uacute;c được bổ sung với chất liệu nh&aacute;m phủ tổng thể cho to&agrave;n bộ hai m&agrave;u xe Đen v&agrave; Xanh Đen, nổi bật vẻ cao cấp, hiện đại cũng như t&ocirc;n vinh gi&aacute; trị cao của mẫu xe. C&aacute;c chi tiết tay dắt sau v&agrave; logo dập nổi chữ &ldquo;Future 125&rdquo; được thay đổi m&agrave;u tạo sự h&ograve;a trộn mới th&uacute; vị v&agrave; g&acirc;y ấn tượng thị gi&aacute;c mạnh mẽ hơn. Phi&ecirc;n bản Cao cấp phanh đĩa &ndash; v&agrave;nh đ&uacute;c được phủ t&ocirc;ng b&oacute;ng l&ecirc;n ba m&agrave;u xe hiện tại l&agrave; Đỏ Đen, Xanh Đen v&agrave; Trắng Đen.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/den-chieu-sang-phia-truoc-luon-sang_800x500px.jpg?1636025836913\" id=\"post-img-1\" rel=\"highlight6747\" title=\"den-chieu-sang-phia-truoc-luon-sang_800x500px\"><img alt=\"den-chieu-sang-phia-truoc-luon-sang_800x500px\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/den-chieu-sang-phia-truoc-luon-sang_800x500px.jpg?1636025836913\" title=\"den-chieu-sang-phia-truoc-luon-sang_800x500px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Phi&ecirc;n bản Ti&ecirc;u chuẩn với phanh đĩa - vanh nan hoa g&acirc;y ấn tượng mới với người d&ugrave;ng nhờ đổi m&agrave;u tem chữ &ldquo;125&rdquo; c&ugrave;ng c&aacute;c chi tiết mặt trước độc đ&aacute;o. Cả hai bản Cao cấp v&agrave; Ti&ecirc;u chuẩn được &aacute;p dụng c&aacute;ch phối m&agrave;u mới tr&ecirc;n c&aacute;c chi tiết nhựa gi&uacute;p h&igrave;nh ảnh xe trở n&ecirc;n năng động hơn. Ngo&agrave;i những điểm nhấn ri&ecirc;ng gi&uacute;p định h&igrave;nh phong c&aacute;ch r&otilde; n&eacute;t, HVN c&ograve;n tạo sự đồng bộ cho to&agrave;n bộ c&aacute;c phi&ecirc;n bản bằng chi tiết phối m&agrave;u từ y&ecirc;n xe, mặt ốp trong xe v&agrave; mặt trước xe, tạo n&ecirc;n h&igrave;nh ảnh tổng thể mới mẻ thu h&uacute;t hơn cho Future 125 FI. Logo &quot;Future&quot; 3D cao cấp l&agrave;m tăng th&ecirc;m vẻ hiện đại v&agrave; sang trọng cho phi&ecirc;n bản mới. Future 125 FI mới duy tr&igrave; sở hữu hệ thống đ&egrave;n pha LED với thiết kế nổi bật c&ugrave;ng cường độ &aacute;nh s&aacute;ng mạnh, gi&uacute;p kh&aacute;ch h&agrave;ng di chuyển an t&acirc;m hơn v&agrave;o ban đ&ecirc;m.&nbsp;</p>\r\n\r\n<p>Trong ph&acirc;n kh&uacute;c xe số cao cấp, Future 125 FI nổi bật nhờ sở hữu động cơ đ&aacute;ng tự h&agrave;o. Mẫu xe kể từ khi ra mắt lu&ocirc;n mang dấu ấn s&acirc;u đậm trong t&acirc;m tr&iacute; kh&aacute;ch h&agrave;ng về sự bền bỉ v&agrave; khả năng tiết kiệm nhi&ecirc;n liệu vượt trội. Đ&acirc;y l&agrave; một trong những l&yacute; do gi&uacute;p Future trở th&agrave;nh một trong những thương hiệu xe số h&agrave;ng đầu tại Việt Nam. Phi&ecirc;n bản mới tiếp tục sở hữu động cơ 125cc danh tiếng của Honda được duy tr&igrave; chất lượng cao với hệ thống phun xăng điện tử (PGM-FI), 4 kỳ, 1 xy-lanh, l&agrave;m m&aacute;t bằng kh&ocirc;ng kh&iacute;, đem lại c&ocirc;ng suất tối đa 6,83 kW tại 7.500 v&ograve;ng/ph&uacute;t v&agrave; m&ocirc;-men xoắn cực đại 10,2 Nm tại 5.500 v&ograve;ng/ph&uacute;t. Động cơ mạnh mẽ với hiệu suất vượt trội m&agrave; vẫn đảm bảo khả năng tiết kiệm nhi&ecirc;n liệu ấn tượng gi&uacute;p phi&ecirc;n bản mới Future 125 FI giữ vững vị thế của m&igrave;nh trong ph&acirc;n kh&uacute;c xe số cao cấp tại Việt Nam.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/ban-cao-cap_xe-xanh-den.jpg?1636025852230\" id=\"post-img-2\" rel=\"highlight6747\" title=\"ban-cao-cap_xe-xanh-den\"><img alt=\"ban-cao-cap_xe-xanh-den\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/ban-cao-cap_xe-xanh-den.jpg?1636025852230\" title=\"ban-cao-cap_xe-xanh-den\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Honda Future 125 FI mới được t&iacute;ch hợp nhiều tiện &iacute;ch hữu dụng, mang đến h&agrave;nh tr&igrave;nh thoải m&aacute;i v&agrave; cảm gi&aacute;c an t&acirc;m hơn cho người l&aacute;i. Hệ thống đ&egrave;n chiếu s&aacute;ng ph&iacute;a trước c&oacute; t&iacute;nh năng lu&ocirc;n s&aacute;ng khi xe vận h&agrave;nh đảm bảo cho người điều khiển xe c&oacute; tầm nh&igrave;n tốt nhất, hạn chế c&aacute;c trường hợp qu&ecirc;n bật đ&egrave;n pha khi đi trong điều kiện &aacute;nh s&aacute;ng kh&ocirc;ng đảm bảo, gi&uacute;p tăng khả năng nhận diện của xe khi lưu th&ocirc;ng tr&ecirc;n đường phố. B&ecirc;n cạnh đ&oacute;, xe cũng tiếp tục được duy tr&igrave; hộc đựng đồ lớn v&agrave; dễ d&agrave;ng để vừa cả mũ bảo hiểm cả đầu. Ổ kh&oacute;a thiết kế hiện đại đa năng &quot;4 trong 1&quot; dễ sử dụng, an to&agrave;n v&agrave; chống gỉ s&eacute;t hiệu quả, bao gồm kh&oacute;a điện, kh&oacute;a từ, kh&oacute;a cổ v&agrave; kh&oacute;a y&ecirc;n, mang lại sự tiện nghi tối đa tr&ecirc;n mọi h&agrave;nh tr&igrave;nh.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/dong-co-125cc-manh-me_800x500px.jpg?1636025860435\" id=\"post-img-3\" rel=\"highlight6747\" title=\"dong-co-125cc-manh-me_800x500px\"><img alt=\"dong-co-125cc-manh-me_800x500px\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/dong-co-125cc-manh-me_800x500px.jpg?1636025860435\" title=\"dong-co-125cc-manh-me_800x500px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Future 125 FI mới sẽ ch&iacute;nh thức c&oacute; mặt tr&ecirc;n thị trường từ ng&agrave;y 10 th&aacute;ng 11 năm 2021 th&ocirc;ng qua hệ thống Cửa h&agrave;ng B&aacute;n xe v&agrave; Dịch vụ do Honda Ủy nhiệm (HEAD) tr&ecirc;n to&agrave;n quốc với chế độ bảo h&agrave;nh 3 năm hoặc 30.000 km (t&ugrave;y theo điều kiện n&agrave;o đến trước) v&agrave; gi&aacute; b&aacute;n lẻ đề xuất như sau:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/anh-chup-man-hinh-2021-11-04-luc-18.38.15.png?1636025913327\" id=\"post-img-4\" rel=\"highlight6747\" title=\"anh-chup-man-hinh-2021-11-04-luc-18.38.15\"><img alt=\"anh-chup-man-hinh-2021-11-04-luc-18.38.15\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/11/01/anh-chup-man-hinh-2021-11-04-luc-18.38.15.png?1636025913327\" title=\"anh-chup-man-hinh-2021-11-04-luc-18.38.15\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',8114,1,'2021-12-04 02:04:09','2022-01-27 10:01:46'),(16,'Honda LEAD 125cc hoàn toàn mới giá từ 39 triệu đồng','posts/K6fE47CZFnef7UKtDPFcRZ5TVGgRzlzpuBlQAZFA.jpg',NULL,'Honda LEAD 125cc sở hữu khối động cơ hoàn toàn mới eSP+, 4 van. Công nghệ động cơ mới đã được áp dụng lần lượt trên mẫu xe tay ga cao cấp của HVN như SH350i, SH125i/150i, Sh mode 125cc.','<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/hinh-xe-2.png\" id=\"post-img-0\" rel=\"view_image_post_6767\" title=\"Honda LEAD 125cc hoàn toàn mới giá từ 39 triệu đồng\"><img alt=\"Honda LEAD 125cc hoàn toàn mới giá từ 39 triệu đồng\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/hinh-xe-2.png\" style=\"width:100%\" /></a></p>\r\n\r\n<p><em>Honda LEAD 125cc sở hữu khối động cơ ho&agrave;n to&agrave;n mới eSP+, 4 van. C&ocirc;ng nghệ động cơ mới đ&atilde; được &aacute;p dụng lần lượt tr&ecirc;n mẫu xe tay ga cao cấp của HVN như SH350i, SH125i/150i, Sh mode 125cc.</em></p>\r\n\r\n<p>Honda LEAD 125cc phi&ecirc;n bản ho&agrave;n to&agrave;n mới sở hữu thiết kế với phong c&aacute;ch thanh lịch h&ograve;a trộn c&ugrave;ng những chi tiết nổi bật vẻ hiện đại m&agrave; vẫn kh&aacute;c biệt. Tổng h&ograve;a c&aacute;c đường n&eacute;t của mẫu xe nổi bật với sự thon gọn, gi&uacute;p tạo cảm gi&aacute;c thoải m&aacute;i khi l&aacute;i xe trong phố. Dọc hai b&ecirc;n th&acirc;n l&agrave; những đường gờ được chạm khắc tinh tế, tạo khối 3D mang đến cho mẫu xe một diện mạo thực sự kh&aacute;c biệt. Điểm s&aacute;ng trong thiết kế c&ograve;n đến từ mặt nạ trước với biểu tượng chữ U nổi bật c&ugrave;ng cụm đ&egrave;n trang tr&iacute; LED.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/fearture_650x490px-03.jpg?1639445641089\" id=\"post-img-1\" rel=\"highlight6767\" title=\"fearture_650x490px-03\"><img alt=\"fearture_650x490px-03\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/fearture_650x490px-03.jpg?1639445641089\" title=\"fearture_650x490px-03\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>HVN &aacute;p dụng chiến lược phi&ecirc;n bản v&agrave; m&agrave;u sắc nhằm tập trung hơn v&agrave;o t&iacute;nh đồng bộ qua từng phi&ecirc;n bản Đặc biệt, Cao cấp v&agrave; Ti&ecirc;u chuẩn của mỗi ph&acirc;n kh&uacute;c. Mỗi phi&ecirc;n bản giờ đ&acirc;y sẽ thể hiện r&otilde; n&eacute;t hơn dấu ấn của m&igrave;nh qua c&aacute;c chi tiết m&agrave;u sắc c&ugrave;ng thiết bị t&iacute;ch hợp nhằm gi&uacute;p kh&aacute;ch h&agrave;ng nhận diện gi&aacute; trị từng phi&ecirc;n bản một c&aacute;ch r&otilde; r&agrave;ng. Phi&ecirc;n bản Đặc biệt của Honda LEAD 125cc sở hữu m&agrave;u X&aacute;m mờ thời thượng, kết hợp c&ugrave;ng tem xe &ldquo;Special Edition&rdquo; với ph&ocirc;ng chữ c&aacute;ch điệu to&aacute;t l&ecirc;n vẻ tinh tế v&agrave; thanh lịch của chủ sở hữu. Chi tiết bổ sung nhỏ nhưng lại tạo hiệu ứng mạnh về ngoại quan, định h&igrave;nh r&otilde; n&eacute;t phong c&aacute;ch v&agrave; gi&aacute; trị sở hữu của mẫu xe. Bản Cao cấp tạo điểm nhấn với 4 m&agrave;u sắc thu h&uacute;t Trắng, Đỏ, Xanh, X&aacute;m, đa dạng dải m&agrave;u sắc cũng như lựa chọn cho kh&aacute;ch h&agrave;ng. Bản Ti&ecirc;u chuẩn được đặt điểm nhấn v&agrave;o thiết kế mặt trước cao cấp, g&oacute;p phần v&agrave;o tổng h&ograve;a ngoại quan thu h&uacute;t, t&ocirc;n vinh n&ecirc;n phong c&aacute;ch sống thanh lịch của người sở hữu.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/hinh-xe-1.png?1639445654963\" id=\"post-img-2\" rel=\"highlight6767\" title=\"hinh-xe-1\"><img alt=\"hinh-xe-1\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/hinh-xe-1.png?1639445654963\" title=\"hinh-xe-1\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>LEAD 125cc sở hữu khối động cơ ho&agrave;n to&agrave;n mới eSP+, 4 van. C&ocirc;ng nghệ động cơ mới đ&atilde; được &aacute;p dụng lần lượt tr&ecirc;n mẫu xe tay ga cao cấp của HVN như SH350i, SH125i/150i, Sh mode 125cc. Việc &aacute;p dụng eSP+ gi&uacute;p đ&aacute;nh dấu tiến tr&igrave;nh ho&agrave;n thiện sức mạnh của dải sản phẩm nhằm đạt được khả năng vận h&agrave;nh vượt trội với mức ti&ecirc;u hao nhi&ecirc;n liệu tối ưu. C&ocirc;ng suất tối đa đạt 8,22 kW tại 8.500 v&ograve;ng/ph&uacute;t v&agrave; m&ocirc; men xoắn cực đại đạt 11,7 N.m tại 5.250 v&ograve;ng/ph&uacute;t. Việc cải thiện hiệu suất nhi&ecirc;n liệu cũng như c&ocirc;ng suất vận h&agrave;nh từ động cơ thế hệ mới eSP+, 4 van.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/fearture_1920x1080px-04.jpg?1639445664582\" id=\"post-img-3\" rel=\"highlight6767\" title=\"fearture_1920x1080px-04\"><img alt=\"fearture_1920x1080px-04\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/fearture_1920x1080px-04.jpg?1639445664582\" title=\"fearture_1920x1080px-04\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tr&ecirc;n phi&ecirc;n bản Đặc biệt v&agrave; Cao cấp, hộc để đồ trước mới t&iacute;ch hợp cổng sạc USB c&oacute; dạng nắp mở tiện lợi như tr&ecirc;n mẫu xe ga cao cấp Sh mode 125cc đ&atilde; được HVN &aacute;p dụng. Honda LEAD sở hữu hộc đựng đồ dưới y&ecirc;n xe cực đại, l&ecirc;n tới 37 l&iacute;t. Thiết kế cốp xe th&ocirc;ng minh gi&uacute;p mở rộng tối đa kh&ocirc;ng gian với mặt đ&aacute;y phẳng v&agrave; diện t&iacute;ch v&ograve;m dưới y&ecirc;n xe, cho ph&eacute;p chứa được 2 mũ bảo hiểm cả đầu cỡ lớn c&ugrave;ng nhiều vật dụng c&aacute; nh&acirc;n kh&aacute;c.</p>\r\n\r\n<p>Động cơ thế hệ mới eSP+, 4 van l&agrave; sự tổng h&ograve;a của những kỹ thuật ti&ecirc;n tiến khi tăng thể t&iacute;ch kh&iacute; nạp của hỗn hợp nhi&ecirc;n liệu v&agrave; kh&ocirc;ng kh&iacute;. Lượng hỗn hợp nhi&ecirc;n liệu kh&ocirc;ng kh&iacute; c&oacute; thể được đốt ch&aacute;y trong một chu kỳ piston tăng l&ecirc;n, đem đến khả năng ph&aacute;t ra c&ocirc;ng suất cao, tạo độ ho&agrave;n hảo trong vận h&agrave;nh. Việc &aacute;p dụng động cơ thế hệ mới thể hiện những nỗ lực ti&ecirc;n phong của HVN trong việc mang c&ocirc;ng nghệ hiện đại, th&acirc;n thiện với m&ocirc;i trường đến với kh&aacute;ch h&agrave;ng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/fearture_1920x1080px-05.jpg?1639445700647\" id=\"post-img-4\" rel=\"highlight6767\" title=\"fearture_1920x1080px-05\"><img alt=\"fearture_1920x1080px-05\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/fearture_1920x1080px-05.jpg?1639445700647\" title=\"fearture_1920x1080px-05\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Phi&ecirc;n bản LEAD 125cc ho&agrave;n to&agrave;n mới sẽ được ch&iacute;nh thức giới thiệu ra thị trường v&agrave;o ng&agrave;y 24 th&aacute;ng 12 năm 2021 th&ocirc;ng qua Hệ thống Cửa h&agrave;ng B&aacute;n xe v&agrave; Dịch vụ do Honda Ủy nhiệm (HEAD) tr&ecirc;n to&agrave;n quốc với chế độ bảo h&agrave;nh 3 năm hoặc 30.000 km (t&ugrave;y theo điều kiện n&agrave;o đến trước) v&agrave; mức gi&aacute; b&aacute;n lẻ đề xuất hấp dẫn như sau:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/anh-chup-man-hinh-2021-12-14-luc-08.32.14.png?1639445631301\" id=\"post-img-5\" rel=\"highlight6767\" title=\"anh-chup-man-hinh-2021-12-14-luc-08.32.14\"><img alt=\"anh-chup-man-hinh-2021-12-14-luc-08.32.14\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/14/anh-chup-man-hinh-2021-12-14-luc-08.32.14.png?1639445631301\" title=\"anh-chup-man-hinh-2021-12-14-luc-08.32.14\" /></a></p>',7372,1,'2021-12-04 02:04:09','2022-01-27 10:38:26'),(17,'Revzone Yamaha Motor: Hệ thống đại lý xe phân khối lớn chính hãng ra mắt khách Việt','posts/dhf0Bl3mmqnTaarVoWcy8OSgTTtqbwLvBLQKusUe.jpg',NULL,'Yamaha Motor Việt Nam vừa tổ chức sự kiện ra mắt Revzone Yamaha Motor nhằm giới thiệu hệ thống phân phối xe phân khối lớn hoàn toàn mới đến với khách hàng.','<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/yzf-r7-hoan-toan-moi-2.jpg\" id=\"post-img-0\" rel=\"view_image_post_6780\" title=\"Revzone Yamaha Motor: Hệ thống đại lý xe phân khối lớn chính hãng ra mắt khách Việt\"><img alt=\"Revzone Yamaha Motor: Hệ thống đại lý xe phân khối lớn chính hãng ra mắt khách Việt\" src=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/yzf-r7-hoan-toan-moi-2.jpg\" style=\"width:100%\" /></a></p>\r\n\r\n<p><em>Yamaha Motor Việt Nam vừa tổ chức sự kiện ra mắt Revzone Yamaha Motor nhằm giới thiệu hệ thống ph&acirc;n phối xe ph&acirc;n khối lớn ho&agrave;n to&agrave;n mới đến với kh&aacute;ch h&agrave;ng.</em></p>\r\n\r\n<p>Tuy gia nhập thị trường xe ph&acirc;n khối lớn trễ hơn so với c&aacute;c đối thủ nhưng đ&acirc;y được xem l&agrave; điểm lợi thế của thương hiệu Nhật Bản khi c&oacute; đủ thời gian nghi&ecirc;n cứu thị trường, hiểu r&otilde; nhu cầu kh&aacute;ch h&agrave;ng v&agrave; ho&agrave;n thiện bộ m&aacute;y vận h&agrave;nh. Sự kiện trực tuyến với th&ocirc;ng điệp &ldquo;Worth The Wait&rdquo; ch&iacute;nh l&agrave; lời phản hồi d&agrave;nh cho c&aacute;c kh&aacute;ch h&agrave;ng đ&atilde; y&ecirc;u th&iacute;ch v&agrave; chờ đợi sự xuất hiện của những sản phẩm đ&igrave;nh đ&aacute;m của Yamaha được giới thiệu tr&ecirc;n to&agrave;n quốc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/mt-10-sp-3.jpg?1641784636154\" id=\"post-img-1\" rel=\"highlight6780\" title=\"mt-10-sp-3\"><img alt=\"mt-10-sp-3\" src=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/mt-10-sp-3.jpg?1641784636154\" title=\"mt-10-sp-3\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hệ thống ph&acirc;n phối v&agrave; đại l&yacute; đầu ti&ecirc;n của Revzone Yamaha Motor</strong><br />\r\n<br />\r\nRevzone Yamaha Motor l&agrave; hệ thống đại l&yacute; xe ph&acirc;n khối lớn ch&iacute;nh h&atilde;ng của Yamaha tại thị trường Việt Nam, với phương ch&acirc;m hoạt động nhằm gia tăng trải nghiệm v&agrave; tối ưu sự h&agrave;i l&ograve;ng của kh&aacute;ch h&agrave;ng. Trong thời gian tới, mục ti&ecirc;u h&agrave;ng đầu của Yamaha ch&iacute;nh l&agrave; tăng sự hiện diện của Revzone Yamaha Motor tr&ecirc;n cả nước v&agrave; đặc biệt l&agrave; thị trường TP. Hồ Ch&iacute; Minh.</p>\r\n\r\n<p>C&aacute;c sản phẩm kinh doanh sẽ tập trung v&agrave;o d&ograve;ng xe ph&acirc;n khối lớn v&agrave; d&ograve;ng xe thể thao hiện hữu. Cụ thể, c&aacute;c sản phẩm tr&ecirc;n 400cc sẽ được nhập khẩu nguy&ecirc;n chiếc từ Nhật Bản, ri&ecirc;ng c&aacute;c xe c&oacute; dung t&iacute;ch dưới 400c được nhập khẩu từ In-đ&ocirc;-n&ecirc;-xi-a. B&ecirc;n cạnh đ&oacute;, Revzone Yamaha Motor c&ograve;n kinh doanh đa dạng c&aacute;c sản phẩm như trang phục, đồ bảo hộ, phụ kiện v&agrave; phụ t&ugrave;ng ch&iacute;nh h&atilde;ng. Đối với mảng dịch vụ, Yamaha cam kết xưởng dịch vụ của Rezone Yamaha Motor l&agrave; một trong những xưởng dịch vụ xe ph&acirc;n khối lớn được ch&uacute; trọng đầu tư kinh ph&iacute; lớn nhất c&ugrave;ng với c&aacute;c trang thiết bị t&acirc;n tiến. Ngo&agrave;i ra, đ&acirc;y cũng l&agrave; hệ thống xưởng dịch vụ xe ph&acirc;n khối lớn ch&iacute;nh h&atilde;ng đầu ti&ecirc;n thực hiện mảng chăm s&oacute;c xe (detailing) tại Việt Nam, hứa hẹn sẽ l&agrave; một luồng gi&oacute; mới trong ng&agrave;nh dịch vụ xe ph&acirc;n khối lớn v&agrave; xe thể thao. Kh&ocirc;ng chỉ thực hiện dịch vụ cho c&aacute;c sản phẩm của thương hiệu Yamaha, đặc biệt hơn, kh&aacute;ch h&agrave;ng sở hữu xe của c&aacute;c thương hiệu kh&aacute;c cũng sẽ được ch&agrave;o đ&oacute;n khi đem xe đến xưởng Revzone Workshop để thực hiện c&aacute;c loại h&igrave;nh dịch vụ, nhằm đ&aacute;p ứng nhu cầu ng&agrave;y c&agrave;ng cao của kh&aacute;ch h&agrave;ng về một xưởng dịch vụ xe ph&acirc;n khối lớn chất lượng cao, quy tr&igrave;nh vận h&agrave;nh chuy&ecirc;n nghiệp v&agrave; gi&aacute; th&agrave;nh cạnh tranh nhất.</p>\r\n\r\n<p>Đại l&yacute; đầu ti&ecirc;n của hệ thống mang t&ecirc;n Revzone Yamaha Motor S&agrave;i G&ograve;n l&agrave; cửa h&agrave;ng 3S (B&aacute;n H&agrave;ng, Dịch Vụ, Phụ T&ugrave;ng) tọa lạc tại tầng trệt t&ograve;a nh&agrave; UOA, số 06 đường T&acirc;n Tr&agrave;o, Phường T&acirc;n Ph&uacute;, Quận 7, TP. HCM. Đ&acirc;y sẽ l&agrave; showroom xe ph&acirc;n khối lớn v&agrave; xe thể thao lớn nhất tại khu vực miền Nam, với diện t&iacute;ch l&ecirc;n đến 1.150m2 v&agrave; được vận h&agrave;nh trực tiếp bởi Yamaha Motor Việt Nam. Tổng thể thiết kế của đại l&yacute; mang phong c&aacute;ch hiện đại, sử dụng ba t&ocirc;ng m&agrave;u chủ đạo x&aacute;m, đỏ v&agrave; đen, tạo n&ecirc;n một kh&ocirc;ng gian kh&aacute;c biệt nhằm hướng đến trải nghiệm mua h&agrave;ng tốt nhất v&agrave; khơi dậy đam m&ecirc; của kh&aacute;ch h&agrave;ng, đ&uacute;ng như &yacute; nghĩa c&acirc;u khẩu hiệu Revs Your Heart của Yamaha. Hiện tại, đại l&yacute; đang trong qu&aacute; tr&igrave;nh ho&agrave;n thiện v&agrave; dự kiến sẽ ch&iacute;nh thức ra mắt v&agrave;o th&aacute;ng 03/2022.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/r7-voi-thiet-ke-dam-chat-the-thao-2.jpg?1641784708387\" id=\"post-img-2\" rel=\"highlight6780\" title=\"r7-voi-thiet-ke-dam-chat-the-thao-2\"><img alt=\"r7-voi-thiet-ke-dam-chat-the-thao-2\" src=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/r7-voi-thiet-ke-dam-chat-the-thao-2.jpg?1641784708387\" title=\"r7-voi-thiet-ke-dam-chat-the-thao-2\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Nền tảng mạng x&atilde; hội v&agrave; thương mại điện tử ho&agrave;n to&agrave;n mới</strong></p>\r\n\r\n<p>Revzone Yamaha Motor sở hữu c&aacute;c k&ecirc;nh truyền th&ocirc;ng v&agrave; mạng x&atilde; hội ho&agrave;n to&agrave;n mới, t&aacute;ch biệt với Yamaha Motor Việt Nam. Kh&aacute;ch h&agrave;ng c&oacute; thể truy cập v&agrave;o trang website Revzone Yamaha Motor v&agrave; fanpage Facebook Revzone Yamaha Motor để t&igrave;m hiểu th&ecirc;m về thương hiệu v&agrave; đặc biệt l&agrave; hệ thống đại l&yacute;. Đ&acirc;y cũng sẽ l&agrave; nơi kh&aacute;ch h&agrave;ng c&oacute; thể nhận được những tư vấn trực tiếp khi lựa chọn mẫu xe, th&ocirc;ng tin về ng&agrave;nh c&ocirc;ng nghiệp xe m&aacute;y, phong c&aacute;ch chơi xe để khai th&aacute;c tối đa tiềm năng chiếc xe của m&igrave;nh.</p>\r\n\r\n<p>Ngo&agrave;i ra, Revzone Yamaha Motor c&ograve;n ph&aacute;t triển v&agrave; x&acirc;y dựng trang thương mại điện tử ri&ecirc;ng biệt ngay tại website. Kh&aacute;ch h&agrave;ng tr&ecirc;n to&agrave;n quốc c&oacute; thể nhanh ch&oacute;ng đặt cọc xe, mua sắm trang phục, phụ kiện v&agrave; g&oacute;i dịch vụ chăm s&oacute;c bảo dưỡng xe trực tuyến, nhằm đem đến những trải nghiệm tốt nhất v&agrave; tiện lợi nhất cho kh&aacute;ch h&agrave;ng, với c&aacute;c h&igrave;nh thức thanh to&aacute;n trực tuyến t&iacute;ch hợp.</p>\r\n\r\n<p><strong>MT-09: Sự lựa chọn tối ưu trong ph&acirc;n kh&uacute;c</strong></p>\r\n\r\n<p>MT-09 l&agrave; mẫu xe với khả năng vận h&agrave;nh v&ocirc; c&ugrave;ng linh hoạt. Xe được trang bị động cơ crossplane 3 xy lanh ho&agrave;n to&agrave;n mới, với c&ocirc;ng suất tăng 3% v&agrave; m&ocirc; men xoắn tăng 6% so với thế hệ trước, sản sinh 119 m&atilde; lực tại v&ograve;ng tua 10.000 v&ograve;ng/ph&uacute;t, với m&ocirc; men xoắn cực đại 93 Nm tại v&ograve;ng tua 7.000 v&ograve;ng/ph&uacute;t. Hệ thống điện tử tr&ecirc;n MT-09 mới được kế thừa những c&ocirc;ng nghệ ti&ecirc;n tiến nhất của đ&agrave;n anh YZF-R1 như cảm biến IMU 6 trục, 4 chế độ l&aacute;i v&agrave; 4 c&ocirc;ng nghệ hỗ trợ người l&aacute;i như kiểm so&aacute;t lực k&eacute;o (TCS), chống b&oacute; cứng phanh ABS t&ugrave;y chỉnh (BC), kiểm so&aacute;t bốc đầu (LIF), hay kiểm so&aacute;t độ trượt b&aacute;nh sau (SCS). MT-09 c&oacute; gi&aacute; b&aacute;n 34X.000.000 đồng với ba m&agrave;u ti&ecirc;u chuẩn l&agrave; xanh, x&aacute;m v&agrave; đen, đi k&egrave;m qu&agrave; tặng trong thời gian đặt trước l&agrave; voucher trị gi&aacute; 5.000.000 đồng d&agrave;nh cho tất cả c&aacute;c sản phẩm trang phục v&agrave; phụ kiện, k&egrave;m một năm cứu hộ miễn ph&iacute;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/2021-yamaha-mt09-5.jpg?1641784350466\" id=\"post-img-3\" rel=\"highlight6780\" title=\"2021-yamaha-mt09-5\"><img alt=\"2021-yamaha-mt09-5\" src=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/2021-yamaha-mt09-5.jpg?1641784350466\" title=\"2021-yamaha-mt09-5\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>MT-10 v&agrave; MT-10 SP: Bộ đ&ocirc;i Hyper Naked với động cơ crossplane trứ danh</strong></p>\r\n\r\n<p>Bộ đ&ocirc;i MT-10 v&agrave; MT-10 SP sở hữu khối động cơ crossplane từ chiếc sportbike lừng danh YZF-R1, với một v&agrave;i tinh chỉnh, cho ra dải m&ocirc; men xoắn rộng hơn đạt 112 Nm tại 9.000 v&ograve;ng/ph&uacute;t c&ugrave;ng c&ocirc;ng suất tối đa 160 m&atilde; lực. Sức mạnh n&agrave;y được truyền tới b&aacute;nh sau qua hộp số 6 cấp với c&ocirc;ng nghệ sang số nhanh Quickshifter. Nhờ thừa hưởng DNA của YZF-R1 n&ecirc;n MT-10 v&agrave; MT-10 SP cũng c&oacute; khung sườn nh&ocirc;m deltabox gọn nhẹ v&agrave; trục cơ sở ngắn nhất ph&acirc;n kh&uacute;c, gi&uacute;p xe cực kỳ linh hoạt ngay cả trong những con phố đ&ocirc; thị đ&ocirc;ng đ&uacute;c. Bộ đ&ocirc;i n&agrave;y c&oacute; khả năng phản hồi ngay lập tức với những thao t&aacute;c của người l&aacute;i th&ocirc;ng qua hệ thống treo cao cấp, hệ thống kiểm so&aacute;t lực k&eacute;o (traction control) hay ga tự động (cruise control). MT-10 c&oacute; ba m&agrave;u cơ bản l&agrave; xanh, x&aacute;m, đen v&agrave; được b&aacute;n ra với mức gi&aacute; 46X.000.000 đồng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/mt-10-voi-dong-co-crossplane-manh-me-3.jpg?1641784340426\" id=\"post-img-4\" rel=\"highlight6780\" title=\"mt-10-voi-dong-co-crossplane-manh-me-3\"><img alt=\"mt-10-voi-dong-co-crossplane-manh-me-3\" src=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/mt-10-voi-dong-co-crossplane-manh-me-3.jpg?1641784340426\" title=\"mt-10-voi-dong-co-crossplane-manh-me-3\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Phi&ecirc;n bản hiệu suất cao MT-10 SP trang bị hệ thống treo điện tử Ohlins ERS gi&uacute;p người l&aacute;i dễ d&agrave;ng điều chỉnh độ phản hồi của hệ thống phuộc trước v&agrave; sau chỉ với v&agrave;i thao t&aacute;c tại cụm điều khiển b&ecirc;n tay tr&aacute;i v&agrave; m&agrave;n h&igrave;nh TFT đa sắc. MT-10 SP v&ocirc; c&ugrave;ng nổi bật với bộ tem x&aacute;m xanh đặc biệt, được lấy cảm hứng từ si&ecirc;u phẩm YZF-R1M, kết hợp m&agrave;u v&agrave;ng gold đặc trưng của hệ thống treo Ohlins danh tiếng v&agrave; gắp sau nh&ocirc;m xước trọng lượng nhẹ, hứa hẹn sẽ thu h&uacute;t mọi &aacute;nh nh&igrave;n nơi chiếc xe đi qua. MT-10 SP c&oacute; gi&aacute; b&aacute;n 51X.000.000 đồng. Kh&aacute;ch h&agrave;ng đặt trước MT-10 hoặc MT-10 SP ngay thời điểm n&agrave;y đều sẽ nhận được qu&agrave; tặng l&agrave; voucher trị gi&aacute; 5.000.000 đồng d&agrave;nh cho tất cả c&aacute;c sản phẩm trang phục v&agrave; phụ kiện, k&egrave;m theo một năm cứu hộ miễn ph&iacute;.</p>\r\n\r\n<p><strong>YZF-R7: Mẫu xe DNA đậm chất thể thao mới nhất của Yamaha</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/r7-xanh-3.jpg?1641784482713\" id=\"post-img-5\" rel=\"highlight6780\" title=\"r7-xanh-3\"><img alt=\"r7-xanh-3\" src=\"http://autoexpress.vn/upload/autoexpress_news/2022/01/07/r7-xanh-3.jpg?1641784482713\" title=\"r7-xanh-3\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>YZF-R7 mang thiết kế supersport đặc trưng của Yamaha, với c&aacute;c đường n&eacute;t tối ưu kh&iacute; động học tr&ecirc;n th&acirc;n xe, từ hốc gi&oacute; chữ M xuy&ecirc;n suốt tới phần đu&ocirc;i vuốt cao. R7 c&ograve;n được thừa hưởng tư thế l&aacute;i thể thao từ c&aacute;c đ&agrave;n anh R6 v&agrave; R1 v&agrave; l&agrave; mẫu xe thon gọn nhất gia đ&igrave;nh R-series của Yamaha với chiều rộng chỉ 705mm. Xe c&oacute; trọng lượng ướt chỉ 188 kg, kết hợp với động cơ crossplane 2 xy lanh 690cc sản sinh 73 m&atilde; lực v&agrave; m&ocirc; men xoắn 67 Nm tại v&ograve;ng tua 6.500 v&ograve;ng/ph&uacute;t, hứa hẹn sẽ tạo n&ecirc;n những c&uacute; bức tốc đầy phấn kh&iacute;ch. YZF-R7 hướng đến những kh&aacute;ch h&agrave;ng trẻ tuổi, đam m&ecirc; thể thao tốc độ v&agrave; bước đầu trải nghiệm d&ograve;ng xe supersport, với hai m&agrave;u l&agrave; xanh v&agrave; đen, k&egrave;m gi&aacute; b&aacute;n 26X.000.000 đồng. Những kh&aacute;ch h&agrave;ng đặt trước R7 trong thời gian n&agrave;y sẽ nhận voucher trị gi&aacute; 3.000.000 đồng d&agrave;nh cho tất cả c&aacute;c sản phẩm trang phục v&agrave; phụ kiện cũng như một năm cứu hộ miễn ph&iacute;.</p>\r\n\r\n<p>&nbsp;</p>',8615,1,'2021-12-04 02:04:09','2022-01-27 09:48:01'),(18,'Ra biển một chiếc xe máy mới tại Việt Nam hết bao nhiêu?','posts/5PjjsaP0zLl1rmzilI66zEbYLdhk2C4C80TiBptk.jpg',NULL,'Mức thuế trước bạ, phí cấp biển số xe khác nhau theo từng tỉnh thành và khu vực do đó ra xe ra biển tại mỗi địa phương cũng có sự chênh lệch nhất định.','<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2016/09/tin-tuc/Honda-SH-ra-bien-bao-nhieu.jpg\" id=\"post-img-0\" rel=\"view_image_post_1241\" title=\"Ra biển một chiếc xe máy mới tại Việt Nam hết bao nhiêu?\"><img alt=\"Ra biển một chiếc xe máy mới tại Việt Nam hết bao nhiêu?\" src=\"http://autoexpress.vn/upload/autoexpress_news/2016/09/tin-tuc/Honda-SH-ra-bien-bao-nhieu.jpg\" style=\"width:100%\" /></a></p>\r\n\r\n<p><em>Mức thuế trước bạ, ph&iacute; cấp biển số xe kh&aacute;c nhau theo từng tỉnh th&agrave;nh v&agrave; khu vực do đ&oacute; ra xe ra biển tại mỗi địa phương cũng c&oacute; sự ch&ecirc;nh lệch nhất định.</em></p>\r\n\r\n<p>Sau khi mua xe m&aacute;y, việc đầu ti&ecirc;n cần phải l&agrave;m l&agrave; đ&oacute;ng ph&iacute; trước bạ tại c&aacute;c chi cục thuế. T&ugrave;y theo hộ khẩu, ở những th&agrave;nh phố trực thuộc trung ương hoặc th&agrave;nh phố thuộc tỉnh mức ph&iacute; trước bạ d&agrave;nh cho xe m&aacute;y l&agrave; 5% tr&ecirc;n khung gi&aacute; của cơ quan thuế, c&aacute;c khu vực c&ograve;n lại mức ph&iacute; n&agrave;y l&agrave; 2%. Nhiều trường hợp xe b&aacute;n ra thấp hơn th&igrave; người mua vẫn đ&oacute;ng ph&iacute; theo khung.</p>\r\n\r\n<p>Gi&aacute; t&iacute;nh lệ ph&iacute; trước bạ l&agrave; gi&aacute; do Ủy ban nh&acirc;n d&acirc;n tỉnh, th&agrave;nh phố trực thuộc Trung ương ban h&agrave;nh, theo quy định cụ thể của Bộ T&agrave;i ch&iacute;nh. Như vậy gi&aacute; t&iacute;nh ph&iacute; trước bạ ở c&aacute;c tỉnh th&agrave;nh l&agrave; kh&aacute;c nhau.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2016/09/xe-moi/Vespa_Primavera_125_ABS_2016_xe_tay_ga_33.jpg\" id=\"post-img-1\" rel=\"highlight1241\" title=\"Chi phí ra biển xe Vespa Primavera 125 ABS 2016\"><img alt=\"Chi phí ra biển xe Vespa Primavera 125 ABS 2016\" src=\"http://autoexpress.vn/upload/autoexpress_news/2016/09/xe-moi/Vespa_Primavera_125_ABS_2016_xe_tay_ga_33.jpg\" title=\"Chi phí ra biển xe Vespa Primavera 125 ABS 2016\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tiếp theo l&agrave; ph&iacute; cấp biển số xe tại c&aacute;c trụ sở c&ocirc;ng an c&oacute; thẩm quyền. Mức ph&iacute; n&agrave;y được t&iacute;nh theo gi&aacute; trị xe v&agrave; cũng ph&acirc;n theo tỉnh th&agrave;nh phố. Tại H&agrave; Nội v&agrave; TP HCM, nếu xe m&aacute;y c&oacute; trị gi&aacute; dưới 15 triệu đồng th&igrave; ph&iacute; l&agrave; 500.000 đồng; xe từ 15-40 triệu ph&iacute; l&agrave; 2 triệu; xe tr&ecirc;n 40 triệu ph&iacute; l&agrave; 4 triệu đồng. C&aacute;c tỉnh kh&aacute;c mức ph&iacute; sẽ dao động 50.000 - 800.000 đồng.</p>\r\n\r\n<p>C&aacute;c loại xe m&aacute;y sẽ kh&ocirc;ng phải đ&oacute;ng ph&iacute; đường bộ v&agrave; ph&iacute; đăng kiểm nhưng bảo hiểm tr&aacute;ch nhiệm d&acirc;n sự l&agrave; bắt buộc v&agrave; c&oacute; thể chọn 3 mức. Bảo hiểm tr&aacute;ch nhiệm d&acirc;n sự: 66.000 đồng; Bảo hiểm tr&aacute;ch nhiệm d&acirc;n sự + Bảo hiểm tai nạn cho 2 người ngồi tr&ecirc;n xe (mức 10 triệu /người): 86.000 đồng; Bảo hiểm tr&aacute;ch nhiệm d&acirc;n sự + Bảo hiểm tai nạn cho 2 người ngồi tr&ecirc;n xe (mức 20 triệu /người): 106.000 đồng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2016/09/tin-tuc/Honda-SH-gia-ban.jpg\" id=\"post-img-2\" rel=\"highlight1241\" title=\"Chi phí ra biển xe Honda SH\"><img alt=\"Chi phí ra biển xe Honda SH\" src=\"http://autoexpress.vn/upload/autoexpress_news/2016/09/tin-tuc/Honda-SH-gia-ban.jpg\" title=\"Chi phí ra biển xe Honda SH\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Honda SH 150</strong></td>\r\n			<td><strong>Chi ph&iacute; (VND)</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Gi&aacute; xe ni&ecirc;m yết</td>\r\n			<td>80.990.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ph&iacute; trước bạ (5% theo khung)</td>\r\n			<td>4.000.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Lệ ph&iacute; cấp biển số xe</td>\r\n			<td>4.000.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Bảo hiểm tr&aacute;ch nhiệm d&acirc;n sự (tối thiểu)</td>\r\n			<td>66.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Tổng</strong></td>\r\n			<td><strong><em>89.056.000</em></strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Hầu hết c&aacute;c cửa h&agrave;ng b&aacute;n xe đều c&oacute; dịch vụ dịch vụ đăng k&yacute; cho kh&aacute;ch h&agrave;ng, chỉ cần chuẩn bị đầy đủ giấy tờ, chi ph&iacute; th&ecirc;m từ 300.000 đồng (t&ugrave;y y&ecirc;u cầu) kh&aacute;ch h&agrave;ng c&oacute; thể chọn mua v&agrave; nhận xe c&oacute; gắn biển số trong ng&agrave;y. Nhiều cửa h&agrave;ng tại TP HCM c&ograve;n đưa lu&ocirc;n gi&aacute; lăn b&aacute;nh của từng loại xe để kh&aacute;ch h&agrave;ng dễ d&agrave;ng lựa chọn.</p>',7591,1,'2021-12-04 02:04:09','2022-01-27 09:42:22'),(19,'“Nữ hoàng” xe tay ga Yamaha Grande - tối ưu hoá chi phí cho người dùng','posts/sPGX00N1RcPAnevc42Zp1JH8eWWvkPcyQGiSPXkN.jpg',NULL,'Yamaha Grande là một trong những mẫu xe nổi bật ở phân khúc xe tay ga 125cc dành cho phái đẹp tại thị trường Việt Nam.','<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/yamaha-grande-1.jpg\" id=\"post-img-0\" rel=\"view_image_post_6677\" title=\"“Nữ hoàng” xe tay ga Yamaha Grande - tối ưu hoá chi phí cho người dùng\"><img alt=\"“Nữ hoàng” xe tay ga Yamaha Grande - tối ưu hoá chi phí cho người dùng\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/yamaha-grande-1.jpg\" style=\"width:100%\" /></a></p>\r\n\r\n<p><em>Yamaha Grande l&agrave; một trong những mẫu xe nổi bật ở ph&acirc;n kh&uacute;c xe tay ga 125cc d&agrave;nh cho ph&aacute;i đẹp tại thị trường Việt Nam.</em></p>\r\n\r\n<p>Với kiểu d&aacute;ng hiện đại, đậm chất ch&acirc;u &Acirc;u đi k&egrave;m nhiều c&ocirc;ng nghệ ti&ecirc;n tiến, Yamaha Grande kh&ocirc;ng chỉ dễ d&agrave;ng sử dụng, m&agrave; c&ograve;n mang lại sự thoải m&aacute;i cho chị em tr&ecirc;n mọi h&agrave;nh tr&igrave;nh v&agrave; đặc biệt khả năng tiết kiệm nhi&ecirc;n liệu dẫn đầu ph&acirc;n kh&uacute;c.</p>\r\n\r\n<p><strong>Mẫu xe tay ga tiết kiệm nhi&ecirc;n liệu dẫn đầu ph&acirc;n kh&uacute;c</strong></p>\r\n\r\n<p>Theo bảng xếp hạng xe tay ga tiết kiệm nhi&ecirc;n liệu từng được B&aacute;o Giao th&ocirc;ng c&ocirc;ng bố năm 2020, Yamaha Grande l&agrave; mẫu xe tiết kiệm nhi&ecirc;n liệu nhất ph&acirc;n kh&uacute;c từ 125cc trở l&ecirc;n, với th&ocirc;ng số theo Cục Đăng kiểm Việt Nam chỉ l&agrave; 1,69 l&iacute;t/ 100 km. Cho đến nay, ng&ocirc;i vị n&agrave;y vẫn chưa bị x&ocirc; đổ khi chưa c&oacute; mẫu xe n&agrave;o c&ugrave;ng ph&acirc;n kh&uacute;c đạt mức ti&ecirc;u thụ nhi&ecirc;n liệu ấn tượng hơn.</p>\r\n\r\n<p>Sở dĩ&nbsp;Yamaha Grande&nbsp;dẫn đầu trong danh s&aacute;ch c&aacute;c mẫu&nbsp;xe&nbsp;m&aacute;y&nbsp;tiết kiệm nhi&ecirc;n liệu&nbsp;nhất Việt Nam l&agrave; do được trang bị c&aacute;c c&ocirc;ng nghệ tối ưu nhất của&nbsp;Yamaha&nbsp;hiện nay, đ&oacute; l&agrave;: khối động cơ Blue Core &ndash; tr&aacute;i tim của tất cả c&aacute;c d&ograve;ng&nbsp;xe tay ga Yamaha, c&oacute; hiệu suất cao, hoạt động ổn định, bền bỉ v&agrave; giảm ti&ecirc;u hao động năng hiệu quả.</p>\r\n\r\n<p>Sử dụng Yamaha Grande, người d&ugrave;ng c&oacute; thể tiết kiệm được một khoản chi ph&iacute; đổ xăng mỗi th&aacute;ng. Về l&acirc;u d&agrave;i, số tiền tiết kiệm được l&agrave; kh&ocirc;ng hề nhỏ, nhất l&agrave; trong bối cảnh gi&aacute; xăng dầu ng&agrave;y c&agrave;ng tăng cao. Giả sử mỗi 100 km sử dụng, Yamaha Grande tiết kiệm được 1 l&iacute;t xăng so với xe tay ga kh&aacute;c th&igrave; nếu sử dụng nhiều, mỗi năm đi khoảng 15.000 km, số tiền tiết kiệm được cũng l&ecirc;n tới cả v&agrave;i triệu đồng.</p>\r\n\r\n<p>Đi c&agrave;ng nhiều, số tiền tiết kiệm được c&agrave;ng lớn v&agrave; nếu xe m&aacute;y l&agrave; phương tiện di chuyển ch&iacute;nh th&igrave; Yamaha Grande ho&agrave;n to&agrave;n l&agrave; sự lựa chọn rất kinh tế d&agrave;nh cho chị em phụ nữ.</p>\r\n\r\n<p><strong>C&ocirc;ng nghệ hiện đại nhất &aacute;p dụng tr&ecirc;n mẫu xe tay ga</strong></p>\r\n\r\n<p>D&ugrave; tiện &iacute;ch đến đ&acirc;u th&igrave; tr&ecirc;n hết, chị em phụ nữ cần một chiếc xe tin cậy, điều khiển an to&agrave;n tr&ecirc;n mọi h&agrave;nh tr&igrave;nh. Thấu hiểu điều n&agrave;y, Yamaha Grande Hybrid được trang bị th&ecirc;m hệ thống chống b&oacute; cứng phanh ABS cho b&aacute;nh trước. Hệ thống n&agrave;y c&oacute; khả năng điều chỉnh lực phanh khi phanh gấp hoặc đường trơn ướt, gi&uacute;p hạn chế hiện tượng trượt b&aacute;nh nguy hiểm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/yamaha-grande-2.jpg?1625833642914\" id=\"post-img-1\" rel=\"highlight6677\" title=\"yamaha-grande-2\"><img alt=\"yamaha-grande-2\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/yamaha-grande-2.jpg?1625833642914\" title=\"yamaha-grande-2\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Th&ecirc;m v&agrave;o đ&oacute;, xe c&ograve;n được t&iacute;ch hợp 2 t&iacute;nh năng gồm: Khởi động với 1 n&uacute;t nhấn (One-Push Start - gi&uacute;p khởi động xe nhanh ch&oacute;ng, dễ d&agrave;ng v&agrave; kh&ocirc;ng g&acirc;y tiếng ồn cho trải nghiệm l&aacute;i mượt m&agrave; v&agrave; ho&agrave;n hảo) v&agrave; hệ thống ngắt động cơ tạm thời (Stop &amp; Start System - c&oacute; chức năng tự động ngắt động cơ khi dừng xe v&agrave; t&aacute;i khởi động khi tăng ga với 2 chế độ th&ocirc;ng thường v&agrave; đường đ&ocirc;ng, gi&uacute;p tiết kiệm nhi&ecirc;n liệu hơn đến 7% trong điều kiện thử nghiệm của Yamaha).</p>\r\n\r\n<p>Nhắc tới c&ocirc;ng nghệ &aacute;p dụng tr&ecirc;n xe Yamaha Grande Hybrid kh&ocirc;ng thể kh&ocirc;ng kể tới động cơ Blue Core thế hệ mới nhất, được ph&aacute;t triển dựa tr&ecirc;n nền tảng triết l&iacute; của động cơ Blue Core nhằm tạo ra một &ldquo;động cơ cốt l&otilde;i xuất sắc&rdquo; v&agrave; vượt trội hơn.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/picture1.jpg?1625833715481\" id=\"post-img-2\" rel=\"highlight6677\" title=\"picture1\"><img alt=\"picture1\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/picture1.jpg?1625833715481\" title=\"picture1\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Động cơ Blue Core thế hệ mới nhất sử dụng hệ thống l&agrave;m m&aacute;t bằng kh&ocirc;ng kh&iacute;, c&oacute; trọng lượng động cơ giảm 840 gram nhờ bộ ph&aacute;t điện th&ocirc;ng minh (Smart Motor Generator) được t&iacute;ch hợp c&ugrave;ng hệ thống trợ lực điện Hybrid mang đến khả năng khởi động mượt m&agrave;, &ecirc;m hơn, khả năng tăng tốc mạnh mẽ v&agrave; tiết kiệm nhi&ecirc;n liệu tối ưu.</p>\r\n\r\n<p>Trải nghiệm thực tế, khi khởi động, động cơ gần như kh&ocirc;ng nghe thấy bất kỳ &acirc;m thanh n&agrave;o m&agrave; chỉ cảm thấy xe rung nhẹ đ&ocirc;i ch&uacute;t. Khi tăng ga, nhờ v&agrave;o bộ ph&aacute;t điện th&ocirc;ng minh m&agrave; chiếc xe di chuyển cực kỳ &ecirc;m &aacute;i. Ngay cả khi đi l&ecirc;n dốc hay cầu vượt, chiếc xe vẫn tỏ ra thừa sức mạnh, tiến l&ecirc;n một c&aacute;ch nhẹ nh&agrave;ng m&agrave; kh&ocirc;ng cảm nhận được bất kỳ sự gắng gượng n&agrave;o. Tiếng động cơ &ecirc;m v&agrave; dễ chịu, m&aacute;y kh&ocirc;ng cảm gi&aacute;c bị qu&aacute; sức ở mỗi lần tăng tốc hay vặn s&acirc;u tay ga.</p>\r\n\r\n<p>Sử dụng trong 2 ng&agrave;y với qu&atilde;ng đường di chuyển trong nội đ&ocirc; khoảng 60 km, đ&aacute;ng ngạc nhi&ecirc;n khi c&oacute; những l&uacute;c đều tay ga, kh&ocirc;ng ph&oacute;ng nhanh, phanh gấp, chiếc xe hiển thị mức ti&ecirc;u hao nhi&ecirc;n liệu chỉ khoảng hơn 1 l&iacute;t/ 100 km.</p>\r\n\r\n<p>C&oacute; thể thấy, động cơ Blue Core thế hệ mới dường như kh&ocirc;ng chỉ l&agrave;m tốt việc vận h&agrave;nh &ecirc;m &aacute;i, mượt m&agrave; m&agrave; c&ograve;n cho khả năng tiết kiệm nhi&ecirc;n liệu ấn tượng.</p>\r\n\r\n<p><strong>Thiết kế qu&yacute; ph&aacute;i, t&ocirc;n vinh ph&aacute;i đẹp</strong></p>\r\n\r\n<p>Yamaha Grande ra đời với sứ mệnh trở th&agrave;nh mẫu xe tay ga ho&agrave;n hảo d&agrave;nh ri&ecirc;ng cho chị em phụ nữ với vẻ bề ngo&agrave;i sang trọng v&agrave; thời thượng. Ở phi&ecirc;n bản mới nhất đang được b&aacute;n ra, phi&ecirc;n bản Grande Blue Core Hybrid, đem đến trải nghiệm tuyệt vời của 3 yếu tố: động cơ Blue Core với hệ thống Hybrid ho&agrave;n to&agrave;n mới, thiết kế ch&acirc;u &Acirc;u tinh tế v&agrave; t&iacute;nh năng hiện đại.</p>\r\n\r\n<p>Đường n&eacute;t ho&agrave;n hảo của Yamaha Grande Hybrid đến từ thiết kế với tầm nh&igrave;n 3 chiều, tạo chiều s&acirc;u cho d&aacute;ng xe cũng như gi&uacute;p t&ocirc;n d&aacute;ng v&oacute;c của người l&aacute;i. Th&ecirc;m v&agrave;o đ&oacute;, đ&egrave;n LED mạ cr&ocirc;m chữ Y ở phần đầu xe cho ấn tượng đẳng cấp vượt trội ở mọi g&oacute;c nh&igrave;n.</p>\r\n\r\n<p>B&ecirc;n cạnh hệ thống đ&egrave;n LED định vị, điểm nhấn ở phần đầu xe c&ograve;n phải kể đến đ&egrave;n pha hai tầng h&igrave;nh kim cương sang trọng. Sự kết hợp giữa 2 tầng đ&egrave;n LED c&ugrave;ng ch&oacute;a đ&egrave;n phản quang gi&uacute;p tầm nh&igrave;n của người l&aacute;i được mở rộng về chiều s&acirc;u.</p>\r\n\r\n<p>Kh&ocirc;ng chỉ sử dụng c&ocirc;ng nghệ đ&egrave;n hiện đại, m&agrave;n h&igrave;nh th&ocirc;ng tin tr&ecirc;n Yamaha Grande cũng l&agrave; trang bị đắt gi&aacute; khi sử dụng loại TFT m&agrave;u sắc n&eacute;t, nổi bật trong ph&acirc;n kh&uacute;c, tạo n&ecirc;n sự cao cấp.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/picture1.png?1625833878976\" id=\"post-img-3\" rel=\"highlight6677\" title=\"picture1\"><img alt=\"picture1\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/picture1.png?1625833878976\" title=\"picture1\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ngo&agrave;i ra, Yamaha Grande Hybrid c&ograve;n đ&aacute;p ứng tốt nhu cầu chứa nhiều đồ của chị em phụ nữ khi cốp xe c&oacute; thể t&iacute;ch l&ecirc;n tới 27 l&iacute;t, c&oacute; thể chứa được 2 mũ bảo hiểm c&ugrave;ng nhiều vật dụng kh&aacute;c. Cốp xe c&ograve;n được trang bị đ&egrave;n LED chiếu s&aacute;ng, gi&uacute;p người d&ugrave;ng t&igrave;m đồ một c&aacute;ch dễ d&agrave;ng.</p>\r\n\r\n<p>Để c&oacute; kh&ocirc;ng gian để đồ rộng r&atilde;i, nắp b&igrave;nh xăng của Grande Hybrid được di chuyển ra ngo&agrave;i cốp, đặt ở đầu xe rất tiện lợi, dễ d&agrave;ng thao t&aacute;c v&agrave; kh&ocirc;ng bị vướng v&iacute;u khi treo đồ.</p>\r\n\r\n<p>Thiết kế tinh tế, t&iacute;nh năng ho&agrave;n hảo, động cơ &ecirc;m &aacute;i v&agrave; đặc biệt l&agrave; khả năng tiết kiệm nhi&ecirc;n liệu vượt trội, Yamaha Grande thực sự l&agrave; một người bạn đồng h&agrave;nh tin tưởng, th&uacute; vị mỗi ng&agrave;y của chị em tr&ecirc;n mọi cung đường.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/picture1_1.jpg?1625833941858\" id=\"post-img-4\" rel=\"highlight6677\" title=\"picture1_1\"><img alt=\"picture1_1\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/07/09/picture1_1.jpg?1625833941858\" title=\"picture1_1\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ngo&agrave;i ra, Yamaha Motor Việt Nam hiện đang triển khai chương tr&igrave;nh khuyến m&atilde;i ch&agrave;o h&egrave; &ldquo;cực hot&rdquo; d&agrave;nh cho Yamaha Grande. Theo đ&oacute;, kh&aacute;ch h&agrave;ng sẽ c&oacute; cơ hội nhận ngay 2 triệu đồng khi mua Yamaha Grande từ ng&agrave;y 1/6 đến ng&agrave;y 31/7/2021. Th&ocirc;ng tin chi tiết vui l&ograve;ng truy cập website Yamaha Motor Việt Nam&nbsp;<a href=\"https://yamaha-motor.com.vn/khuyen-mai/he-cuc-boc-cung-yamaha-tang-toc/\">tại đ&acirc;y</a>.</p>',1050,1,'2021-12-04 02:04:09','2022-01-27 09:36:42'),(20,'Honda WINNER X 2022 nhiều nâng cấp đáng tiền chính thức ra mắt','posts/ZeqwhHdZozdW9bElBQ1teyPfWTegS5oMATc5CtNK.jpg',NULL,'Honda WINNER X sở hữu thiết kế mới ấn tượng cùng nhiều nâng cấp đáng tiền sẽ khiến các đối thủ cùng phân khúc phải dè chừng.','<p>Honda WINNER X được lấy &yacute; tưởng xuy&ecirc;n suốt to&agrave;n bộ thiết kế b&aacute;m s&aacute;t &ldquo;chất DNA si&ecirc;u xe thể thao&rdquo; đặc trưng với sự ph&aacute;t huy tối đa yếu tố &ldquo;NĂNG ĐỘNG THỂ THAO&rdquo; v&agrave; &ldquo;MẠNH MẼ NAM T&Iacute;NH&rdquo; nhằm tạo n&ecirc;n h&igrave;nh ảnh mẫu xe chuẩn ngầu cho người Việt trẻ trung, c&aacute; t&iacute;nh.&nbsp;</p>\r\n\r\n<p>WINNER X 2022 thế hệ ho&agrave;n to&agrave;n mới sở hữu thiết kế mang t&iacute;nh kh&iacute; động học cao, trở th&agrave;nh n&eacute;t đặc trưng mạnh mẽ trong DNA của mẫu xe. Mặt nạ trước được kho&aacute;c l&ecirc;n m&igrave;nh một bộ gi&aacute;p ngoại h&igrave;nh mới đậm chất ngầu, g&oacute;c cạnh với c&aacute;c đường cắt n&eacute;t tạo h&igrave;nh chữ V nổi bật sự năng động.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/phien-ban-tieu-chuan_xe-bac-den.jpg?1640521525269\" id=\"post-img-1\" rel=\"highlight6771\" title=\"phien-ban-tieu-chuan_xe-bac-den\"><img alt=\"phien-ban-tieu-chuan_xe-bac-den\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/phien-ban-tieu-chuan_xe-bac-den.jpg?1640521525269\" title=\"phien-ban-tieu-chuan_xe-bac-den\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Người sử dụng c&oacute; thể dễ d&agrave;ng nhận thấy sự kh&aacute;c biệt ho&agrave;n to&agrave;n ở phi&ecirc;n bản mới qua c&aacute;c đường v&aacute;t đầu xe sắc nhọn, hầm hố, nối liền l&agrave; đ&egrave;n LED xi nhan trước được t&iacute;ch hợp gọn v&agrave;o hai b&ecirc;n yếm xe, h&agrave;i h&ograve;a trong tổng thể ngoại quan đậm chất thể thao. To&agrave;n bộ hệ thống đ&egrave;n của thế hệ mới được trang bị c&ocirc;ng nghệ LED.</p>\r\n\r\n<p>Th&acirc;n xe nh&igrave;n từ hai b&ecirc;n nổi bật vẻ đẹp nam t&iacute;nh, mạnh mẽ th&ocirc;ng qua cấu tr&uacute;c khung sườn sắc n&eacute;t. Tổng thể mẫu xe gợi l&ecirc;n h&igrave;nh ảnh của những thủ lĩnh đang bứt tốc trong d&ograve;ng chảy li&ecirc;n tục của &aacute;nh s&aacute;ng v&agrave; tốc độ. Điểm c&acirc;n bằng ph&iacute;a sau được n&acirc;ng cao, kết hợp với đu&ocirc;i xe gọn mới gi&uacute;p WINNER X 2022 thế hệ mới mang chất si&ecirc;u xe thể thao kh&ocirc;ng thể h&ograve;a lẫn.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/kieu-dang-sieu-the-thao-dam-chat-khi-dong-luc-3300x1952px.jpg?1640521538690\" id=\"post-img-2\" rel=\"highlight6771\" title=\"kieu-dang-sieu-the-thao-dam-chat-khi-dong-luc-3300x1952px\"><img alt=\"kieu-dang-sieu-the-thao-dam-chat-khi-dong-luc-3300x1952px\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/kieu-dang-sieu-the-thao-dam-chat-khi-dong-luc-3300x1952px.jpg?1640521538690\" title=\"kieu-dang-sieu-the-thao-dam-chat-khi-dong-luc-3300x1952px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Phi&ecirc;n bản ho&agrave;n to&agrave;n mới sở hữu thiết kế mặt đồng hồ được cải tiến tinh tế, sử dụng c&ocirc;ng nghệ LCD với diện t&iacute;ch m&agrave;n h&igrave;nh lớn. Điểm nhấn tr&ecirc;n mặt đồng hồ mới thể hiện ở h&igrave;nh ảnh &acirc;m bản đậm chất si&ecirc;u xe gi&uacute;p người l&aacute;i quan s&aacute;t dễ d&agrave;ng thuận tiện v&agrave;o ban đ&ecirc;m; c&ocirc;ng tơ m&eacute;t được bố tr&iacute; hiển thị c&aacute;c chỉ số một c&aacute;ch dễ nh&igrave;n v&agrave; thuận tiện cho người sử dụng, mang lại cảm gi&aacute;c hưng phấn trong từng khoảnh khắc trải nghiệm c&ugrave;ng chỉ số b&aacute;o th&ocirc;ng minh.</p>\r\n\r\n<p>Điểm nhấn tiếp theo trong thiết kế thế hệ mới WINNER X 2022 đến từ ống xả mới. G&oacute;c nghi&ecirc;ng của đu&ocirc;i ống xả được giảm xuống 20 độ, tạo sự thoải m&aacute;i tối đa cho cả người lưu th&ocirc;ng ph&iacute;a sau m&agrave; vẫn giữ được chất &acirc;m thanh phấn kh&iacute;ch đặc trưng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/he-thong-khoa-thong-minh-hoan-toan-moi_3300x1952px.jpg?1640521553229\" id=\"post-img-3\" rel=\"highlight6771\" title=\"he-thong-khoa-thong-minh-hoan-toan-moi_3300x1952px\"><img alt=\"he-thong-khoa-thong-minh-hoan-toan-moi_3300x1952px\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/he-thong-khoa-thong-minh-hoan-toan-moi_3300x1952px.jpg?1640521553229\" title=\"he-thong-khoa-thong-minh-hoan-toan-moi_3300x1952px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>WINNER X 2022 được trang bị khối động cơ mạnh mẽ với cam đ&ocirc;i DOHC l&agrave;m m&aacute;t bằng dung dịch, 4 kỳ xi lanh đơn kết hợp c&ugrave;ng hộp số 6 cấp, sản sinh c&ocirc;ng suất tối đa 11,5 kW tại 9.000 v&ograve;ng/ph&uacute;t, m&ocirc;-men xoắn cực đại 13,5 Nm tại 6.500 v&ograve;ng/ph&uacute;t. Với động cơ hiệu suất cao, kết hợp c&ugrave;ng &acirc;m thanh p&ocirc; xe cải tiến mới đầy uy lực, WINNER X thế hệ mới tiếp tục g&acirc;y ấn tượng với người d&ugrave;ng bằng cảm gi&aacute;c l&aacute;i đầy phấn kh&iacute;ch. Mẫu xe kh&ocirc;ng chỉ đem đến sự tăng tốc mạnh mẽ ở dải tốc độ thấp (từ 0 đến 200m chỉ trong 10.9 gi&acirc;y) m&agrave; c&ograve;n gi&uacute;p người l&aacute;i cũng c&oacute; thể tận hưởng cảm gi&aacute;c tăng tốc mượt m&agrave; ở dải tốc độ cao.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/cong-sac-usb-tien-loi_3300x1952px.jpg?1640521563115\" id=\"post-img-4\" rel=\"highlight6771\" title=\"cong-sac-usb-tien-loi_3300x1952px\"><img alt=\"cong-sac-usb-tien-loi_3300x1952px\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/cong-sac-usb-tien-loi_3300x1952px.jpg?1640521563115\" title=\"cong-sac-usb-tien-loi_3300x1952px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>B&ecirc;n cạnh thiết kế ho&agrave;n to&agrave;n mới, WINNER X c&ograve;n được trang bị nhiều t&iacute;nh năng vượt trội g&oacute;p phần tạo n&ecirc;n đẳng cấp xứng tầm si&ecirc;u xe thể thao. WINNER X trang bị hệ thống kh&oacute;a th&ocirc;ng minh Honda SMART Key tr&ecirc;n cả 3 phi&ecirc;n bản Thể Thao, Đặc biệt v&agrave; Ti&ecirc;u chuẩn, như c&aacute;c mẫu xe ga h&agrave;ng đầu hiện nay.</p>\r\n\r\n<ul>\r\n	<li>&nbsp;Khả năng chống trộm tối ưu: Honda SMART Key tr&ecirc;n thế hệ mới WINNER X c&oacute; chức năng m&atilde; h&oacute;a an to&agrave;n, kết hợp với cảnh b&aacute;o chống trộm từ xa. C&aacute;c phương thức đấu điện hay ph&aacute; ổ kh&oacute;a tr&aacute;i ph&eacute;p ho&agrave;n to&agrave;n được ngăn chặn, gi&uacute;p tối ưu h&oacute;a khả năng chống trộm cho xe, đem lại cảm gi&aacute;c an t&acirc;m hơn cho cho sở hữu.</li>\r\n	<li>&nbsp;T&iacute;nh năng cao cấp: 3 chức năng bao gồm cảnh b&aacute;o chống trộm, x&aacute;c định vị tr&iacute; xe th&ocirc;ng minh v&agrave; khởi động hệ thống điện được t&iacute;ch hợp tr&ecirc;n thiết bị điều khiển FOB, mang lại cho người d&ugrave;ng sự tiện lợi vượt trội v&agrave; trải nghiệm cao cấp.</li>\r\n	<li>&nbsp;Thiết kế thời trang: Ổ kh&oacute;a &amp; ch&igrave;a kh&oacute;a th&ocirc;ng thường được thay thế ho&agrave;n to&agrave;n bằng n&uacute;m xoay khởi động v&agrave; thiết bị điều khiển FOB nhỏ gọn. Đặc biệt, ổ kh&oacute;a th&ocirc;ng minh được gắn đ&egrave;n LED xanh mỗi khi hoạt động mang lại h&igrave;nh ảnh cao cấp v&agrave; thời thượng hơn.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/he-thong-chong-bo-cung-phanh-abs_3300x1952px.jpg?1640521578184\" id=\"post-img-5\" rel=\"highlight6771\" title=\"he-thong-chong-bo-cung-phanh-abs_3300x1952px\"><img alt=\"he-thong-chong-bo-cung-phanh-abs_3300x1952px\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/23/he-thong-chong-bo-cung-phanh-abs_3300x1952px.jpg?1640521578184\" title=\"he-thong-chong-bo-cung-phanh-abs_3300x1952px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tr&ecirc;n phi&ecirc;n bản Đặc biệt v&agrave; Thể thao, thế hệ mới được trang bị hai t&iacute;nh năng mới đ&aacute;ng gi&aacute; bao gồm: bộ sạc USB loại A c&oacute; nắp chống nước đặt ở ph&iacute;a trước xe gi&uacute;p n&acirc;ng cao gi&aacute; trị sử dụng; x&iacute;ch c&oacute; v&ograve;ng phớt O (Seal chain) tiết kiệm thời gian bảo dưỡng xe mỗi ng&agrave;y d&ugrave; l&aacute;i xe tr&ecirc;n qu&atilde;ng đường d&agrave;i, đồng thời tăng độ bền cho x&iacute;ch v&agrave; gi&uacute;p xe vận h&agrave;nh &ecirc;m &aacute;i hơn. B&ecirc;n cạnh đ&oacute;, thế hệ mới WINNER X 2022 tiếp tục duy tr&igrave; hệ thống chống b&oacute; cứng phanh ABS cho b&aacute;nh trước tr&ecirc;n hai phi&ecirc;n bản Đặc biệt v&agrave; Thể thao.</p>\r\n\r\n<p>Thế hệ mới si&ecirc;u phẩm WINNER X 2022 sẽ ch&iacute;nh thức được b&aacute;n ra thị trường từ ng&agrave;y 04/01/2022. Mức gi&aacute; b&aacute;n lẻ đề xuất như sau:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/25/anh-chup-man-hinh-2021-12-26-luc-19.19.59.png?1640521461413\" id=\"post-img-6\" rel=\"highlight6771\" title=\"anh-chup-man-hinh-2021-12-26-luc-19.19.59\"><img alt=\"anh-chup-man-hinh-2021-12-26-luc-19.19.59\" src=\"http://autoexpress.vn/upload/autoexpress_news/2021/12/25/anh-chup-man-hinh-2021-12-26-luc-19.19.59.png?1640521461413\" title=\"anh-chup-man-hinh-2021-12-26-luc-19.19.59\" /></a></p>',1583,1,'2021-12-04 02:04:09','2022-01-27 10:37:27');
